INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(64784, 'zhCN', '9.0 Rated PvP Incentive - Shadowlands Season 2 Exclusive Mount', '', '', '', '', '', '', '', '', 39653),
(64651, 'zhCN', '眼镜蛇之魂', '把眼镜蛇之魂带给森林之心中的曼恩女士。', '<眼镜蛇之魂贪婪而充满保护欲。你将掌握眼镜蛇形态。>', '', '', '', '', '', '把眼镜蛇之魂带给森林之心中的曼恩女士。', 39653),
(64650, 'zhCN', '土狼之魂', '把土狼之魂带给森林之心中的曼恩女士。', '<土狼之魂急躁而活泼。你将掌握土狼形态。>', '', '', '', '', '', '把土狼之魂带给森林之心中的曼恩女士。', 39653),
(64640, 'zhCN', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'zhCN', '塔扎维什 ：困难的交易', '寻找奥·玛纳尔的商业合伙人并提供帮助。', '啊，我的作品在你身上效果惊人。简直就是给你量身打造的！\n\n既然我已经出手帮忙了，你也应该出出力了。跟我的商业合伙人菲·塔吉德谈谈，就在鎏金登陆港，你去跟他说你可以帮忙。\n\n希望听到你成功的消息。', '', '', '', '', '', '', 39653),
(64599, 'zhCN', '统御圣所——诅咒难脱', '从史诗难度的统御圣所的克尔苏加德处收集4枚护命匣碎片。', '我能感觉到克尔苏加德就在这些大厅里。把他的护命匣碎片带给我，我就能打开新的通路进入他的密室。\n\n四枚碎片就足够了。你肯定不想让他又一次卷土重来吧？', '', '', '', '', '', '', 39653),
(64598, 'zhCN', '统御圣所——诅咒难脱', '从英雄难度的统御圣所的克尔苏加德处收集4枚护命匣碎片。', '我能感觉到克尔苏加德就在这些大厅里。把他的护命匣碎片带给我，我就能打开新的通路进入他的密室。\n\n四枚碎片就足够了。你肯定不想让他又一次卷土重来吧？', '', '', '', '', '', '', 39653),
(64597, 'zhCN', '统御圣所——诅咒难脱', '从普通难度的统御圣所的克尔苏加德处收集4枚护命匣碎片。', '我能感觉到克尔苏加德就在这些大厅里。把他的护命匣碎片带给我，我就能打开新的通路进入他的密室。\n\n四枚碎片就足够了。你肯定不想让他又一次卷土重来吧？', '', '', '', '', '', '', 39653),
(64571, 'zhCN', '塔扎维什：寻找而非损坏', '', '', '', '', '', '', '', '', 39653),
(64567, 'zhCN', '失踪的学者', '在刻希亚找到学者罗-遂尔。', '啊，噬渊行者。你的归来让我们大受鼓舞，也会给我们带来很大的帮助。\n\n有几位学者仍然下落不明。上次我们见到他们时，他们应该还在大厅中做研究。我们担心他们迷失了，或者遇到了更坏的情况，被那些想要干涉我们生活方式的人捉去了。\n\n如果你能找到答案，请回来找我。\n\n愿正途指引着你。', '', '', '', '', '', '', 39653),
(64562, 'zhCN', '诚招治疗——就是你！', '在求知者议事堂治疗$1oa名受伤的盟约盟友。', '战场上的伤员太多了！\n\n不是每个人都是“敲两下就能好”的，我们需要更多治疗者。\n\n你，拿上我的装置，让伤员们重整旗鼓！', '', '', '', '', '', '', 39653),
(64561, 'zhCN', '观察记录', '从刻希亚的啸风之巢和觉醒河口收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n啸风之巢和觉醒河口的记录应该已经准备就绪，可以收集了。你看不到那些装置，但你能找到明亮的宝珠，那就是数据。\n\n也别忘记探查地下！\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(64560, 'zhCN', '心能回收', '从指引圣地的吞噬者身上取回$1oa份被吞噬的心能。', '我们在此地的战事需要源源不断的补给，兵员、物资和心能都需要。显而易见，心能的供给是最困难的，但我早已学会了灵活做事。\n\n附近就有一处充足的心能来源。吞噬者正在涌入指引圣地。它们不会像那些灵魂一样，被揍了就能吐出心能，但只要你足够强大，其实也可以做得到。你行吗？', '', '', '', '', '', '', 39653),
(64557, 'zhCN', '黑暗中的寻觅', '在托加斯特，罪魂之塔找到威·尼什。', '威财团总喜欢潜入到危险的地方去寻找宝藏，这是大家都知道的事儿。如果他们还有理智的话，就该把收购和销售货物的事情留给塞财团。唉。\n\n一个威财团的成员带着抢来的盒子消失在了托加斯特，里面装着很多强大的物品，他觉得这样就可以安全地探索了。真是疯子！', '', '', '', '', '', '', 39653),
(64556, 'zhCN', '亟需帮助', '在刻希亚完成米卡尼科斯、塔·娜茜和凯尔萨斯的三个日常任务。', '刻希亚的居民经历了很多苦难。如果不是我们的到来，典狱长的部队早已蹂躏了这座绝密之城的残骸，只留下毁灭与废墟。\n\n要继续推进我们的事业，就必须向落难者伸出援手。\n\n响应盟友们的召唤，噬渊行者。不要放过这里的任何一砖一石，更不要给典狱长的盟友留下活路。', '', '', '', '', '', '', 39653),
(64555, 'zhCN', '调查秘密', '与刻希亚的前锋斥候交谈。', '每个盟约都派出了他们各个专长领域中的专家。其中有一些已经开始实地调查这片未知的土地了。\n\n和他们谈谈，他们身上应该带着调查的报告。把报告带回来给我。', '', '', '', '', '', '', 39653),
(64554, 'zhCN', '温西尔突袭', '在破灭堡和湮灭真容完成$1oa个任务。', '典狱长的部队被我们的攻击打了个措手不及。我们要趁势拿下破灭堡，击败他位于统御祭坛的勇士！\n\n我们需要你的帮助，噬渊行者。在战场上协助我们的部队！', '', '', '', '', '', '', 39653),
(64553, 'zhCN', '心能之涌的传说', '将心能之涌的传说交给堕罪堡的战术家莎卡雅。', '<这看上去是一套残缺笔记中的一部分，详细记载了一位档案员寻找隐藏在刻希亚深处某地的一座神秘的心能之泉的过程。\n\n堕罪堡的战术家莎卡雅会帮助你组织一支队伍去寻找它。>', '', '', '', '', '', '将心能之涌的传说交给堕罪堡的战术家莎卡雅。', 39653),
(64552, 'zhCN', '心能之涌的传说', '将心能之涌的传说交给极乐堡的科罗斯。', '<这看上去是一套残缺笔记中的一部分，详细记载了一位档案员寻找隐藏在刻希亚深处某地的一座神秘的心能之泉的过程。\n\n极乐堡的科罗斯会帮助你组织一支队伍去寻找它。>', '', '', '', '', '', '将心能之涌的传说交给极乐堡的科罗斯。', 39653),
(64551, 'zhCN', '心能之涌的传说', '将心能之涌的传说交给兵主之座的梅里克·菲尔德斯卡。', '<这看上去是一套残缺笔记中的一部分，详细记载了一位档案员寻找隐藏在刻希亚深处某地的一座神秘的心能之泉的过程。\n\n兵主之座的梅里克·菲尔德斯卡会帮助你组织一支队伍去寻找它。>', '', '', '', '', '', '将心能之涌的传说交给兵主之座的梅里克·菲尔德斯卡。', 39653),
(64549, 'zhCN', '心能之涌的传说', '将心能之涌的传说交给森林之心的守护者暮花。', '<这看上去是一套残缺笔记中的一部分，详细记载了一位档案员寻找隐藏在刻希亚深处某地的一座神秘的心能之泉的过程。\n\n森林之心的守护者暮花会帮助你组织一支队伍去寻找它。>', '', '', '', '', '', '将心能之涌的传说交给森林之心的守护者暮花。', 39653),
(64541, 'zhCN', '死亡的代价', '', '', '', '', '', '', '', '', 39653),
(64532, 'zhCN', '最后的圣物', '在追忆圣窟查看丢失的圣物，并购买研究报告：远古神龛。', '我有非常好的消息要告诉你，$n。我整理出了最后一批遗失的圣物！\n\n想找到它们的所在可能有点困难，但我已经研究出了合适的方式来协助你。\n\n请去查看我们最后一批遗失的圣物清单。我们已经快要把它们都找齐了！', '', '', '', '', '', '', 39653),
(64531, 'zhCN', '莫盖斯', '', '', '', '', '', '', '', '', 39653),
(64530, 'zhCN', '墓翼蝠水晶', '把墓翼蝠水晶交给守护者的休憩的锻石师。', '<这块大型水晶碎片从巨型构造体上掉了下来。闪烁的能量在水晶片里劈啪作响。\n\n守护者的休憩的锻石师也许可以用这块水晶为你驱动一只墓翼蝠。>', '', '', '', '', '', '把墓翼蝠水晶交给守护者的休憩的锻石师。', 39653),
(64529, 'zhCN', '完整的北风长核心', '把完整的北风长核心交给守护者的休憩的迪奥斯。', '<那只巨大的吞噬者死的时候，拳头里抓着这个北风长核心，毫无疑问是从附近一台损坏的北风长身上剥下来的。能量核心几乎完好无损。\n\n守护者的休憩的迪奥斯也许能够帮你找到一台北风长，你可以用这个核心为它供能。>', '', '', '', '', '', '把完整的北风长核心交给守护者的休憩的迪奥斯。', 39653),
(64528, 'zhCN', '荒蚺鞍座', '把荒蚺鞍座交给守护者的休憩的雷尔多恩。', '<你从逃脱的荒蚺背上滑下来，甩脱的鞍座就落在你脚下。它不情愿地离开了你的身边，法夜的人把它带回了守护者的休憩。\n\n守护者的休憩的雷尔多恩也许知道它的动作到底意味着什么。>', '', '', '', '', '', '把荒蚺鞍座交给守护者的休憩的雷尔多恩。', 39653),
(64527, 'zhCN', '追击观察', '开启战争模式，在世界PvP中消灭$1oa名玩家。', '在观察你们这些族群的冲突时，我们注意到，被攻击的一方有很大几率会逃跑。\n\n这对我们的观察任务是非常不利的。\n\n观察者获得了一件工具，我们相信它可以增强你们强化冲突的能力。\n\n在把它交给你之前，我们希望你能证明你有参与这类冲突的意愿，这样我们的投资也就能够得到相应的回报了。', '', '', '', '', '', '', 39653),
(64526, 'zhCN', '神秘裂隙', '在追忆圣窟查看丢失的圣物，并从罗-遂尔那里购买一枚修复的裂隙钥匙。', '非常感谢你的帮助，$n。我已经筛查出了目录上其他保存完好的圣物。\n\n寻找这些圣物的关键就在刻希亚那些奇异的裂隙里。\n\n我可以给你打开一条通道，进入这些裂隙，找回更多丢失的圣物。\n\n和以往一样，我会给你提供样本，让你知道这些圣物的样子。离开之前记得去看看。', '', '', '', '', '', '', 39653),
(64522, 'zhCN', '失窃的刻希亚补给品', '把失窃的刻希亚补给品交给守护者的休憩的女公爵麦恩克丝。', '<这些补给品上盖着死亡先锋军的印记，被人从裂隙里偷了出来，无人察觉。\n\n把它交还给守护者的休憩的女公爵麦恩克斯，她会非常感激的。>', '', '', '', '', '', '把失窃的刻希亚补给品交给守护者的休憩的女公爵麦恩克丝。', 39653),
(64521, 'zhCN', '冥誓作战计划', '把冥誓作战计划交给守护者的休憩的女公爵麦恩克丝。', '<这些作战计划中描述了各种可能对刻希亚发起攻击的方案细节，包括死亡先锋军在这一地区防御力量的详细报告。\n\n守护者的休憩的女公爵麦恩克丝可以尽快将这些情报交到需要的人手上。>', '', '', '', '', '', '把冥誓作战计划交给守护者的休憩的女公爵麦恩克丝。', 39653),
(64519, 'zhCN', '失落的宝物', '在追忆圣窟查看丢失的圣物。', '我已经对那些仍然存留在刻希亚的圣物进行了研究。我估计它们都还被保存在我们的小型仓库里。\n\n有了你的帮助，我可以重新制造出一些装备，用来修复这些仓库的入口。\n\n我把仍未找到的圣物的复制品放置好了。你可以去看看它们，然后就知道需要找什么东西了。', '', '', '', '', '', '', 39653),
(64513, 'zhCN', '威·蕾恩的徽记', '把威·蕾恩的徽记交给威·娜莉的庇护所的威·娜莉。', '<威·蕾恩追捕威·娜莉很长时间了。威·娜莉一定很想看到自己永远摆脱掉这个威胁的证据。>', '', '', '', '', '', '把威·蕾恩的徽记交给威·娜莉的庇护所的威·娜莉。', 39653),
(64511, 'zhCN', '失落的圣物', '在追忆圣窟查看丢失的圣物。', '感谢你的帮助，有了这些宝库中失去的圣物，我就能够取回更多的研究成果了。\n\n我已经检查了一遍列表，发现刻希亚还有更多可以找回的圣物。\n\n这些圣物都被封印在了箱子里，我猜在刻希亚最早受到攻击的时候，它们就已经散落在各处了。\n\n我列出了这些丢失的圣物。请务必把它们带回这里来。', '', '', '', '', '', '', 39653),
(64509, 'zhCN', '时髦的伪装', '', '', '', '', '', '', '', '', 39653),
(64508, 'zhCN', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'zhCN', '重要失物', '在追忆圣窟中查看哪些圣物丢失了。', '卷宗里记载了很多细节。有些物品已经永久遗失了，但有些仍然存在。\n\n有些强大的圣物仍然完好无损，就藏在刻希亚的某个地方。\n\n到追忆圣窟去。你可以看到刻希亚有哪些圣物仍然完整。\n\n记住它们，找到它们，把它们带回来。', '', '', '', '', '', '', 39653),
(64469, 'zhCN', '冒险者：露西亚', '', '', '', '', '', '', '', '', 39653),
(64468, 'zhCN', '冒险者：艾扎夫人', '', '', '', '', '', '', '', '', 39653),
(64467, 'zhCN', '冒险者：艺人查其', '', '', '', '', '', '', '', '', 39653),
(64466, 'zhCN', '冒险者：死亡之牙', '', '', '', '', '', '', '', '', 39653),
(64465, 'zhCN', '冒险者：恩克拉多斯', '', '', '', '', '', '', '', '', 39653),
(64464, 'zhCN', '冒险者：莱拉·雹风', '', '', '', '', '', '', '', '', 39653),
(64463, 'zhCN', '冒险者：金辉灵魂向导', '', '', '', '', '', '', '', '', 39653),
(64462, 'zhCN', '冒险者：秘术师克罗马斯', '', '', '', '', '', '', '', '', 39653),
(64461, 'zhCN', '冒险者：赫尔墨斯忒斯', '', '', '', '', '', '', '', '', 39653),
(64460, 'zhCN', '冒险者：娅恩拉', '', '', '', '', '', '', '', '', 39653),
(64459, 'zhCN', '冒险者：艾尔雯', '', '', '', '', '', '', '', '', 39653),
(64458, 'zhCN', '冒险者：苏拉努姆', '', '', '', '', '', '', '', '', 39653),
(64441, 'zhCN', '松脱之线', '拾取书籍并送还。', '<这本书似乎是附近的温西尔营地里的东西。\n\n如果你能赶在跃足兽把它拿去筑巢之前捡回书本，交还给温西尔，他们肯定会感谢你。>', '', '', '', '', '', '', 39653),
(64438, 'zhCN', '强化装备', '与助理学者卡-威兹交谈，使用编集研究升级一件在刻希亚找到的装备。', '你找到的研究成果能够解开许多种可能性。\n\n其中之一就是强化你在刻希亚寻获的装备。\n\n在附近与我的助手谈谈，他可以运用我们的研究成果，让这件装备恢复昔日的力量。', '', '', '', '', '', '', 39653),
(64437, 'zhCN', '告知兵主', '返回刻希亚的兵主身边。', '$n，返回刻希亚告知兵主，寒冬女王的印记已被恢复。', '', '', '', '', '', '', 39653),
(64432, 'zhCN', '优劣转化', '强化引雷针，并使用它消灭渊誓者。', '$p，我们一直找寻的废金属具有一些奇特的性质。我开始相信，渊誓者给自己的护甲注入了魔力，提升了它们的耐久度。\n\n带上这根引雷针，首先，你要想办法被闪电击中。别摆出那副表情，你不会有事的。另外，你一定要用渊誓金属接地。啸风之巢附近那条嵌入刻希亚土地的巨大锁链应该是个合适的地点。\n\n当你……呃……浑身注满了电能后，我会派荒牛——博哈斯，带你冲入战斗。', '', '', '', '', '', '', 39653),
(64376, 'zhCN', '追踪任务', '', '', '', '', '', '', '', '', 39653),
(64368, 'zhCN', '圣物效率', '', '', '', '', '', '', '', '', 39653),
(64325, 'zhCN', '堕罪堡老兵', '与奥利波斯飞地的佐·索尔格见面。', '堕罪堡的影响更强了，这都是你的功劳，$n！\n\n即使在雷文德斯之外，你的成就也是有目共睹的。\n\n我们胜利的传说在奥利波斯的大厅中回荡。争端大师佐·索尔格想要在飞地与你见面。\n\n他对兵法十分感兴趣。我建议你别让他久等了。', '', '', '', '', '', '', 39653),
(64324, 'zhCN', '通灵领主老兵', '与奥利波斯飞地的佐·索尔格见面。', '通灵领主的力量越发壮大，这都是你的功劳，$n！\n\n即使在玛卓克萨斯之外，你的成就是也有目共睹的。\n\n我们胜利的传说在奥利波斯的大厅中回荡。争端大师佐·索尔格想要在飞地与你见面。\n\n他对兵法十分感兴趣。我建议你别让他久等了。', '', '', '', '', '', '', 39653),
(64323, 'zhCN', '格里恩老兵', '与奥利波斯飞地的佐·索尔格见面。', '多亏了你，$n。晋升堡垒正在痊愈。道路已经明晰。\n\n即使在晋升堡垒之外，你的成就也是有目共睹的。\n\n我们胜利的传说在奥利波斯的大厅中回荡。争端大师佐·索尔格想要在飞地与你见面。\n\n他对兵法十分感兴趣。我建议你别让他久等了。', '', '', '', '', '', '', 39653),
(64322, 'zhCN', '法夜老兵', '与奥利波斯飞地的佐·索尔格见面。', '多亏了你，炽蓝仙野好久没有这么安全了。\n\n即使在炽蓝仙野之外，你的成就也是有目共睹的。\n\n我们胜利的传说在奥利波斯的大厅中回荡。争端大师佐·索尔格想要在飞地与你见面。\n\n他对兵法十分感兴趣。我建议你别让他久等了。', '', '', '', '', '', '', 39653),
(64314, 'zhCN', '新生的盟约', '与兵主交谈，然后取得各个盟约的印记。', '之前我们一直在专心阻止典狱长粉碎噬渊周围的屏障，入侵暗影界的其他地方。\n\n但事实上，他一直在扩张噬渊本身的范围，想要包围奥利波斯，取得执政官的印记。\n\n我并不是很清楚我们在托加斯特上方看到的一切意味着什么。但兵主肯定能够理解。\n\n是时候启动他的应急计划了。很快，各大盟约都会带着他们的印记来到这里。\n\n告诉兵主我们已经准备好了。', '', '', '', '', '', '', 39653),
(64306, 'zhCN', '任务完成进度', '', '', '', '', '', '', '', '', 39653),
(64304, 'zhCN', '寻觅新机遇', '在刻希亚消灭$1oa名玩家。', '匆匆忙忙的，这是要去哪儿啊？噢，对了。你，噬渊行者——你不会碰巧要去探索噬渊中神秘莫测的新地块吧？\n\n我对那里深埋的秘密非常好奇。\n\n也许我们可以互相帮个小忙。\n\n如果你感兴趣，我们可以继续商讨，否则请继续走你的路吧。我可以去找其他人。', '', '', '', '', '', '', 39653),
(64292, 'zhCN', '游荡者梅莉', '接受照顾梅莉的职责。', '真心感谢你找到了梅莉！你知道吗，我觉得自己有些应付不了她。\n\n你愿意照看她吗？我觉得她肯定很喜欢你。', '', '', '', '', '', '', 39653),
(64290, 'zhCN', '收集研究成果', '与档案员罗-遂尔交谈，上交任意刻希亚圣物以换取编集研究。', '你做得很好，为我们收集了这些碎片，它们是重建档案馆的一大助力。\n\n我可以利用你找到的物品进一步研究，了解在刻希亚失落的珍藏。\n\n之后，我们还需要你在刻希亚寻找更多碎片和圣物，以此扩充我们的档案馆。', '', '', '', '', '', '', 39653),
(64289, 'zhCN', '拾捡碎片', '从刻希亚的稀有生物和宝箱中取回50个圣物碎片。', '刻希亚被拖进噬渊时，我们遭受了重大的损失。\n\n无价的圣物被撕成碎片。我看到许多生物都携带着圣物的残迹。\n\n必须将碎片找回来。\n\n你需要和典狱长的部队战斗，寻找那些刻希亚的残片，它们曾属于我们光辉的宝库。', '', '', '', '', '', '', 39653),
(64288, 'zhCN', '威·娜莉的典范', '在噬渊的威·娜莉的庇护所与威·娜莉交谈。', '来吧，噬渊行者。到我的庇护所来找我。\n\n我们要讨论最后一件大事。\n\n……千万不要被人跟踪了。', '', '', '', '', '', '', 39653),
(64287, 'zhCN', '档案员卷宗的典范', '在刻希亚的追忆圣窟与档案员罗-遂尔交谈。', '为了复原我们最珍视的一切，你付出了莫大的努力，噬渊行者。\n\n等你准备好了，请到我的房间来找我。我们要讨论最后一件大事。', '', '', '', '', '', '', 39653),
(64282, 'zhCN', '惊喜连连', '找到佐瓦尔的宝箱。', '你总能令我惊喜，噬渊行者，真没想到你会在这里出现！\n\n既然都在这里，我们就应该并肩合作。\n\n典狱长有个装满奇珍异宝的宝箱，就在裂隙的某个地方。你帮我找到它，或者把它带来打开，我们就能一起分享财富！', '', '', '', '', '', '返回威·娜莉身边，无论是否找到佐瓦尔的宝箱。', 39653),
(64274, 'zhCN', '追踪任务', '', '', '', '', '', '', '', '', 39653),
(64273, 'zhCN', '压制冥誓者', '', '', '', '', '', '', '', '', 39653),
(64267, 'zhCN', '威·娜莉的神秘礼物', '在噬渊的威·娜莉的庇护所与威·娜莉交谈。', '你能在勉力求生的途中做出此等贡献，这种纯粹的坚毅令我刮目相看，噬渊行者。你让我想起了那个年纪尚青、天真无邪的自己。\n\n拿上这个，到不那么……显眼的地方去，继续你的工作。', '', '', '', '', '', '', 39653),
(64266, 'zhCN', '档案员卷宗的补给', '与刻希亚追忆圣窟的档案员罗-遂尔交谈。', '你的精诚奉献令刻希亚的历史得以保全，言语也无法表达我心中的温暖。\n\n请允许我传达我的谢意。', '', '', '', '', '', '', 39653),
(64255, 'zhCN', '派对时间', '', '', '', '', '', '', '', '', 39653),
(64216, 'zhCN', '塔楼学识', '将万物之盒放在托加斯特中。', '这个盒子里交杂着力量，只有饲以骄傲和回忆才能解锁。它的罗网中包含着咒文，其他的界域曾用其吸取或调和灵魂。这个……怪物……用救赎与荣耀之具打造了一把锁。\n\n在你挑战托加斯特的时候，你的技巧、速度和效率都会增加这个盒子吞食的塔楼学识。\n\n饲育它，然后夺取其中蕴含的力量吧。', '', '', '', '', '', '将万物之盒放在托加斯特中。', 39653),
(64214, 'zhCN', '希望之征', '协助检查安度因的罗盘。', '在安度因跟着典狱长穿过传送门之前，他落下了一件东西。\n\n我不知道那是什么，但吉安娜把它拣起来了。也许这意味着安度因仍然在反抗典狱长！\n\n我们要搞清楚那东西是什么，搞清楚他为什么把它留给了我们。', '', '', '', '', '', '', 39653),
(64213, 'zhCN', '希望之征', '帮助吉安娜查看安度因的罗盘。', '在安度因跟着典狱长穿过传送门之前，他落下了一件东西。\n\n我想这并不是典狱长计划的一部分。这一定意味着安度恩的灵魂仍然属于他自己！\n\n<吉安娜摊开手掌，向你展示了一个金色的罗盘。>\n\n这东西对安度因有着很重要的意义。我能够感觉到他的存在。\n\n我们要搞清楚他为什么把它留给了我们。', '', '', '', '', '', '', 39653),
(64212, 'zhCN', '黑暗门廊', '与萨尔交谈，见证托加斯特战事的终结。', '恐怕我们阻止佐瓦尔的努力会受到阻碍，凡人。\n\n一扇通往禁忌界域的大门打开了……被流放者重新获得了很久之前被夺走的力量。\n\n我能感觉到，你的盟友从统御圣所回来了。我必须了解他们知道的所有详情。', '', '', '', '', '', '', 39653),
(64211, 'zhCN', '黑暗门廊', '与吉安娜交谈，见证托加斯特战事的终结。', '恐怕我们阻止佐瓦尔的努力会受到阻碍，凡人。\n\n一扇通往禁忌界域的大门打开了……被流放者重新获得了很久之前被夺走的力量。\n\n我能感觉到，你的盟友从统御圣所回来了。我必须了解他们知道的所有详情。', '', '', '', '', '', '', 39653),
(64210, 'zhCN', '万物之盒', '将万物之盒带给刻符者。', '啊，噬渊行者，当然是你。我很快就要完蛋了，永远被这个地方所吞噬，而你却能继续在大厅中游荡，毫发无伤。\n\n我最大的愿望就是能靠这盒子活下去，遗憾的是，我高估了自己的能力。\n\n但我想我没有高估你的能力。带上这个盒子吧。证明你的实力配得上它。', '', '', '', '', '', '', 39653),
(64202, 'zhCN', '给你露一手', '接受耐迦尼赫玛特的帮助。', '噬渊行者，你的力量……甚至能与被佐瓦尔分离肉体前的我匹敌。\n\n这只是我全部力量的一小部分，但也绰绰有余了……\n\n让我帮助你对抗佐瓦尔吧。这样我就能完成复仇了。', '', '', '', '', '', '', 39653),
(64194, 'zhCN', '战争原型机', '在啸风之巢中使用阿特里奥斯原型机，击败贾克西斯。', '身为掌炉宗师，我一直追求精益求精！\n\n但是最大的百心长实在是太过巨大，难以被搬到刻希亚来。这个问题我也搞定了。认识一下阿特里奥斯，战地巨像原型，格里恩的先锋机！\n\n它需要测试，更多测试，必须照着强大的对手来完善性能。\n\n去吧，带上阿特里奥斯，击败一头强大的噬渊兽吧！按钮随便按！', '', '', '', '', '', '', 39653),
(64191, 'zhCN', '拉西克的装备', '', '', '', '', '', '', '', '', 39653),
(64190, 'zhCN', '稳手的盘子', '', '', '', '', '', '', '', '', 39653),
(64189, 'zhCN', '金尼萨的支援', '', '', '', '', '', '', '', '', 39653),
