(64168, 'zhCN', '勇士：玛拉斯缪斯的孢子', '', '', '', '', '', '', '', '', 39653),
(64166, 'zhCN', '回忆随机访问', '使用瞬息之翼收集刻希亚回忆。', '当典狱长捕获刻希亚，将它拖入噬渊的时候，大部分区域都被损毁了。被毁灭的不只有群峦和楼宇，还有人民。\n\n那些人民都有自己的性命、希望和回忆。\n\n我不禁在想，它们不可能全都就此消逝了。我们也许还能挽救一些遗存之物。\n\n带上我的力量，看看你能不能收集那些回忆。把它们带回来，我会保管好它们。\n\n无论是谁，都不应该被忘却。', '', '', '', '', '', '', 39653),
(64138, 'zhCN', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'zhCN', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64106, 'zhCN', '勠力同心', '在噬渊中协助各个盟约，袭击典狱长的部队。', '你已经将你所在的盟约内部乃至整个暗影界都团结了起来。正是由于这种羁绊，他们才决定要协助我们的事业。\n\n他们已经做好了准备，会与我们并肩作战，进军噬渊。\n\n每个盟约都会从不同的区域袭击典狱长。在这片危机四伏的土地上，帮助他们清剿佐瓦尔的爪牙，阻断他那不断扩张的势力。', '', '', '', '', '', '', 39653),
(64103, 'zhCN', '老办法最管用', '消灭渊誓者指挥官摩罗斯、俄匊斯和阿帕提。', '$p。我们又在一起并肩战斗保护暗影界了。\n\n我们正在发起一场必败之战，但或许依然有可能将形势逆转。我需要你从渊誓者的部队中找出几位指挥官。每支队伍中，指挥官的素质都良莠不齐。我们干掉那些能力强的，只留下些菜鸟，那么整支部队就都被削弱了。\n\n我们的眼线带回来了几个名字，现在我只需要你去干掉他们。', '', '', '', '', '', '', 39653),
(64101, 'zhCN', '妥当程序', '收集$1oa个失落的心能容器。', '我来这儿原本是为了观察雷文德斯访客的行为，但我碰上了值得关切的情况。\n\n$p，侍神者告诉我，他们将心能存储在罐子中，如今却被我们的人掠走了。这事本不该发生。\n\n我能否请你去取回心能，以便将它交还到合适的地方？', '', '', '', '', '', '', 39653),
(64092, 'zhCN', '追猎胡恩', '穿上伪装，躲避卫兵，在统御要塞中搜寻胡恩·高岭。', '胡恩就在某个地方……但因为最近恐惧魔王惹出了不少麻烦，锻石师不肯让任何人进入自己的领域。卫兵不会放行，他们会把看上去不属于这里的人都扫地出门。\n\n不过胡恩很幸运，棍脸和我想出了一个绝妙的计划！\n\n我们只需要让自己融入当地就行了，然后就能到处打听，找到胡恩。轻而易举！', '', '', '', '', '', '', 39653),
(64091, 'zhCN', '玛尔关到死', '收集束缚魔印', '<恐惧魔王引起了你的注意，他似乎想要说些什么。你瞥了一眼同伴，月莓正带着淘气的笑容催你上前。你鼓起勇气，尽可能地靠了上去。>\n\n把我从笼子里放出来，凡人，你就能获得我的恩惠。我所侍奉的力量远超这些可悲的傀儡或是他们的主子。他们对真正的力量一无所知。\n\n我只需要将我关押在此的束缚魔印。其他的……我都能解决。\n\n放我出去，我就赐予你无上的伟力。', '', '', '', '', '', '', 39653),
(64090, 'zhCN', '大榨榨', '前往棍脸认为胡恩被带往的地方，随后乔装潜入。', '所以我们走丢的蓝牛被拖到大榨榨去了。好在我很聪明，知道该怎么做。\n\n我们假装是在这儿工作，别看那些长牙怪，轻手轻脚地摸进去，找到你们的大角鹿，然后像挖石头一样手起凿落。懂了吗？', '', '', '', '', '', '', 39653),
(64086, 'zhCN', '格里恩战略家', '与奥利波斯飞地的佐·索尔格见面。', '看看周围，$n。极乐堡傲然屹立，正是我们已经取得的成就的象征，这都多亏了你。\n\n佐·索尔格再次请你去奥利波斯见他。抓紧时间。\n\n佐财团的青睐正是我们梦寐以求的。掮灵部族的信任可不是轻易就能获得。\n\n也许他们会给你更多的奖励。', '', '', '', '', '', '', 39653),
(64085, 'zhCN', '法夜战略家', '与奥利波斯飞地的佐·索尔格见面。', '你的勇敢举动让炽蓝仙野再度生机勃勃。这也又一次吸引了掮灵们的目光。\n\n佐·索尔格再次请你去奥利波斯见他。抓紧时间。\n\n佐财团的青睐正是我们梦寐以求的。掮灵部族的信任可不是轻易就能获得。\n\n也许他们会给你更多的奖励。', '', '', '', '', '', '', 39653),
(64084, 'zhCN', '通灵领主战略家', '与奥利波斯飞地的佐·索尔格见面。', '你让通灵领主赢得了伟大的荣耀。这样的成就再度吸引了人们的目光。\n\n佐·索尔格再次请你去奥利波斯见他。抓紧时间。\n\n佐财团的青睐正是我们梦寐以求的。掮灵部族的信任可不是轻易就能获得。\n\n也许他们会给你更多的奖励。', '', '', '', '', '', '', 39653),
(64083, 'zhCN', '堕罪堡战略家', '与奥利波斯飞地的佐·索尔格见面。', '堕罪堡赢得了更多的尊敬，就连德纳修斯都做不到！这多亏了你的努力，$n。\n\n佐·索尔格再次请你去奥利波斯见他。抓紧时间。\n\n佐财团的青睐正是我们梦寐以求的。掮灵部族的信任可不是轻易就能获得。\n\n也许他们会给你更多的奖励。', '', '', '', '', '', '', 39653),
(64080, 'zhCN', '渊誓坠地', '使用柯莱恩的标枪刺穿$1oa名渊誓先锋。', '我能听见那些飞在天上的渊誓者扇动翅膀嘲讽我们的声音。\n\n但抓在手中的鸟就能任我们摆布了。\n\n拿上我的标枪证明你的准头，把他们打下来几只然后消灭掉。\n\n噢，一定要用标枪。别在他们身旁闲逛，他们会为了追你而降落到地面。那样就没意思了。\n\n我想看到你把他们从空中拽下来。', '', '', '', '', '', '', 39653),
(64070, 'zhCN', '保持斗志', '收集$1oa份渊誓者废金属。', '我们的军队永远需要更多的武器、护甲和士兵。永远。\n\n我们增援部队就要到了，但是以这种速度，我没办法为所有人提供足够的武装——特别是在没有足够的熔炉和助手的情况下。\n\n我们只能将就一下了。我需要你帮我从渊誓者身上搜刮任何你能找得到的废金属。至于如何将其变成趁手的武器，我来想办法。', '', '', '', '', '', '', 39653),
(64065, 'zhCN', '本地材料', '收集$1oa个碎皮熊之爪、$2oa个跃足兽的脚和$3oa刀翼兽尖刺。', '刻希亚真是个奇怪的地方，这儿的野生动物与众不同，估计是多年受到宝库及其内藏影响的缘故吧。\n\n你准备好做一些试验了吗？我们首先要准备一大堆材料。\n\n在求知者议事堂附近，你能找到碎皮熊、跃足兽和刀翼兽。小心它们的尖刺！', '', '', '', '', '', '', 39653),
(64043, 'zhCN', '诚招治疗——就是你！', '在求知者议事堂治疗$1oa名受伤的盟约盟友。', '战场上的伤员太多了！\n\n不是每个人都是“敲两下就能好”的，我们需要更多治疗者。\n\n你，拿上我的装置，让伤员们重整旗鼓！', '', '', '', '', '', '', 39653),
(64042, 'zhCN', '月夜仪式', '协助准备工作和仪式进行。', '泰兰德时日无多，我们必须尽快行动。\n\n<伊瑟拉忧虑地皱起了眉头。>\n\n我们本希望集结更多月夜战神，但现在我们只能依靠现有的几人，并希望这足以帮助她。\n\n<伊瑟拉摇了摇头，看起来坚定了决心。>\n\n在我们开始以前，我们必须为仪式做好最终的准备。请带上最后这些物品，和我们到林地中会和。', '', '', '', '', '', '', 39653),
(64018, 'zhCN', '顽石之重', '协助顽石军团投递补给和心能。', '战役还在继续，$p。顽石军团会在此扭转战局。\n\n首先，我们必须向盟友投递补给。刻希亚的土地支离破碎，只有我们能够确保部队补给充沛。\n\n其次，我们必须解决渊誓者和吞噬者。我的战术很简单，向渊誓者抛投心能，这样就能吸引吞噬者前去袭击他们。不是渊誓者死，就是吞噬者亡，而我们总能坐收渔利。', '', '', '', '', '', '', 39653),
(64014, 'zhCN', '来自噬渊的教诲', '请求威·娜莉的帮助，将伊尔斯卡号角与噬渊绑定。', '在光荣的战斗开始之前还有一个任务。号角必须连接到噬渊，这样它所发出的声音才能穿透包裹着那片邪恶界域的屏障。\n\n具体要如何行事，我并不知晓。去找一位了解那片区域秘密的人为你提供指引吧。\n\n丹妮卡和她的姐妹将会听从伊尔斯卡号角的召唤。在你需要的时候，她们会响应你的，$n。', '', '', '', '', '', '', 39653),
(64012, 'zhCN', '死亡先锋军的补给', '与刻希亚守护者的休憩的女公爵麦恩克丝交谈。', '你为阻止典狱长的挺进所付出的努力有目共睹。如果你是在为了继续达成目标而寻求力量的话，我或许能提供帮助。', '', '', '', '', '', '', 39653),
(64007, 'zhCN', '盟约的冲锋', '集结盟约大军并勇闯噬渊。', '感谢你和其他艾泽拉斯英雄的努力，盟约的势力逐步壮大。但我们不能再被动地等待典狱长的下一步行动了。\n\n通往噬渊的道路已经开启，我们的部队也整装待发。\n\n盟约都等着你的信号，$n。', '', '', '', '', '', '与刻希亚的伯瓦尔·弗塔根交谈。', 39653),
(63994, 'zhCN', '噬渊行者是哪位？', '参加塔尔-加兰的噬渊行者试炼。', '刻希亚的预言揭示，有一位噬渊行者将会前来，于危难之中拯救我们。\n\n那一天也许正是今日，也许不是。我必须测试你的心能，查验你的话语。\n\n如果你所言不虚，那么我还将履行一项神圣的职责——在我们继续之前先强化你的心能。', '', '', '', '', '', '', 39653),
(63990, 'zhCN', '月夜之刃', '在智识塔陵中搜寻线索。', '经过一番艰难的追查，我找到了有关另外两位月夜战神的可靠线索，其中之一就在玛卓克萨斯。\n\n这座高塔记录了所有抵达玛卓克萨斯的灵魂，其中有一位被称为“月夜之刃”。这应该就是那位月夜战神。\n\n我一路上遇到了很多陷阱，塔里想必也是危机重重。有人似乎想要阻止我们。\n\n我们绝不让他们得逞。', '', '', '', '', '', '', 39653),
(63989, 'zhCN', '泥出风采', '在重殴者之台帮助烦烦测试感染能力。', '学徒！我一直在找你呢。\n\n在我们的试验中，凯文一直是个尽心尽力的好助手。我想给其他的软泥好好训练一番，让它们也能帮忙！\n\n你可以把烦烦带上，测试一下它感染有机生命体的能力吗？', '', '', '', '', '', '', 39653),
(63987, 'zhCN', '威·洛遗失的包裹', '', '', '', '', '', '', '', '', 39653),
(63986, 'zhCN', '塔扎维什：夺宝奇兵', '进入塔扎维什，击败索·莉亚。', '亲爱的朋友，看来你又要展示一下武力了。塔扎维什安保肯定不会让我们大摇大摆地走进去。\n\n但我们必须要阻止索·莉亚，哪怕要用上些许……武力手段，这也是必要的恶行。\n\n带上几名朋友吧，我有预感，这里的安保肯定藏有不少花招。', '', '', '', '', '', '', 39653),
(63985, 'zhCN', '帷纱集市', '搭乘驳船前往塔扎维什。', '让我猜猜……是塔·欧库让你来找我的，对吗？\n\n<塔·麦利看了看你递出的硬币。>\n\n这么说，你想要到塔扎维什去。我们通常不会对财团外的人提供这样的服务，但既然费用已经付过了，我也很乐意帮助你。\n\n上船吧。要记住，全程不要把身体的任何部位伸出船外。间域里的气流总是变幻无常。', '', '', '', '', '', '', 39653),
(63984, 'zhCN', '摆渡人的硬币', '与奥利波斯的塔·麦利交谈。', '你已经履行了交易中的承诺，噬渊行者。现在该给你报酬了。\n\n我的财团有一条往返于奥利波斯和塔扎维什之间的渡轮航线。这是货运航线，但和万事万物总会有……破例的时候。\n\n把这枚硬币带给塔·麦利，你就能安全地前往集市了。\n\n此后的事情都看你自己了。\n\n<塔·欧库向你鞠了个躬，发出了像是轻笑一样的声音。>', '', '', '', '', '', '与奥利波斯的塔·麦利交谈。', 39653),
(63983, 'zhCN', '交货地点', '取回北风长原型机。', '塔·恩拉要的东西非常……特别……是给客户准备的。\n\n格里恩正在建造一种全新的百心长，他们管它叫“北风长”。我派了几名贸易专员去取一台所谓的原型机，但他们至今没有回来。\n\n拿不到东西，我自然没法向塔·恩拉发货。也许我们可以互相帮助。\n\n如果你能找到一台北风长，把它带到这里来，我就帮你进入塔扎维什。', '', '', '', '', '', '', 39653),
(63982, 'zhCN', '不在其位', '使用午夜集市的传送门并与塔·欧库交谈。', '我确实知道帷纱集市所在何处，但在交通方面我恐怕帮上不什么忙。\n\n为了报答你的帮助，我可以送你去见一个人，这样对我们两个都有好处。你可以到晋升堡垒的塔财团中转站去，那是掮灵的领地。那里有一位赏金猎人，是帮助你的最佳人选……而且他还欠了我一票货。\n\n去和塔·欧库谈谈，告诉他是塔·恩拉派你来的。\n\n我给你提供个方便，走这边的传送门吧。毕竟我们是合作伙伴，对吧？', '', '', '', '', '', '与塔财团中转站的赏金猎人塔·欧库交谈。', 39653),
(63980, 'zhCN', '寻找走私贩', '与午夜集市的鉴定者塔·恩拉交谈。', '我们掮灵早已明白，时刻保持机动是最符合我们利益的行事方式。同时还要小心谨慎。\n\n我们把一些城市与哨所藏在了间域之中，它们可以在不同的地点间移动。\n\n但令我烦恼的是，我似乎失去了塔扎维什的踪迹。\n\n我想最好的办法就是去找塔财团，询问入口的位置。他们一直在追踪这些东西，而且引以为荣。\n\n到雷文德斯的午夜集市去碰碰运气吧。那里的掮灵比他们在奥利波斯的同类更好打交道一些。', '', '', '', '', '', '与雷文德斯午夜集市的鉴定者塔·恩拉交谈。', 39653),
(63979, 'zhCN', '鬼祟龌龊之事', '找到属于索财团的出货单。', '索财团的头领对暗影界来说是重大的威胁，噬渊行者。\n\n她名叫索·莉亚。她想要组装起初诞者的一件神器，用它的力量实现其自私的目的。\n\n据说那件神器的一些碎片被隐藏在了你原来的世界中。掮灵此前一直没能找到前往那里的道路，但如果索·莉亚找到了，那么艾泽拉斯也将陷入危机。\n\n我们必须阻止她。\n\n附近有一辆索财团的马车。也许载货单上会有一些线索，能让我们找到他们的头领所在的位置。', '', '', '', '', '', '', 39653),
(63977, 'zhCN', '内幕交易', '与奥利波斯各处的多个掮灵财团交谈。', '我虽然是掮灵文化的专家，但财团之间的关系还是太错综复杂且变幻莫测了。\n\n索财团的一小部分成员在奥利波斯出现了，这意味着其他财团可能知道一些我不知道的信息。到附近打听一下吧，你在这里名声很好，肯定能打听到一些我们之前错过的情报。', '', '', '', '', '', '', 39653),
(63976, 'zhCN', '奥利波斯的奥妙', '在奥利波斯与神秘的联络人碰面。', '啊，噬渊行者，我给你带来了消息。\n\n有人指名要和你会面。我对具体细节一无所知，不过他们请你到伊底里亚的背面找他们。', '', '', '', '', '', '在奥利波斯与神秘的联络人碰面。', 39653),
(63973, 'zhCN', '两个宗主', '帮助宗主艾莉奥瑟击败沿途的敌人并消灭德雷特纳尔领主。', '放松，$p。深呼吸。\n\n<织梦者缓缓地吸气和呼气。>\n\n情况变得越来越紧张，但这并不意味着你需要紧张起来。\n\n一切都会好起来的。如果你不相信，那就让宗主艾莉奥瑟和宗主塔什穆尔有力的实际行动安抚你的心灵吧。\n\n他们已经动身上山，要为我们清出一条道路。他们马上就会处理好一切的。', '', '', '', '', '', '在俯瞰滋长的黑暗的桥头与赫尔恩勋爵会面。', 39653),
(63970, 'zhCN', '一个灵魂也不能少', '在戈尔格亚使用席尔纳克斯的营救摇篮营救$3oa名迷失的德鲁伊，并将其送回至席尔纳克斯身边。', '被困在戈尔格亚的那些饱受折磨的灵魂，你听到他们的哭声了吗？\n\n扭曲的聚魂之河在我们面前流淌，它的波涛中涌动着的，是对不应有此下场的受害者的残忍和折磨。\n\n我们勇敢的一众德鲁伊灵魂带头冲入了聚魂之河，去寻找那些迷失之魂，但他们中的许多人恐怕也已经和那些灵魂一起被困在了痛苦之中。\n\n鼓起你的勇气，带上我的摇篮进入聚魂之河。将你找到的迷失之魂放到摇篮上面，然后让摇篮回到我的身边。', '', '', '', '', '', '在俯瞰滋长的黑暗的桥头与席尔纳克斯会面。', 39653),
(63969, 'zhCN', '黑暗幽影', '收集$1oa本渊誓仪式之书、$2oa个渊誓公函残片和$3oa份暗髓。', '寒冬女王在此召集狩猎，是因为有报告称大量非自然的黑暗在上游区域涌动。\n\n荒猎团虽然勇敢，但并不莽撞。在冲进去之前，我们必须了解该如何应对这种黑暗。\n\n在附近的敌人尸体上搜寻线索。', '', '', '', '', '', '在俯瞰滋长的黑暗的桥头与赫尔恩勋爵会面。', 39653),
(63964, 'zhCN', '掮灵悬赏：阴爪', '从阴爪身上取得成熟的骨化之喙。', '新的陆地会带来新的机遇。致相关人士：如果有人能够从被称为“阴爪”的野兽身上取得完好无损的骨质鸟喙，我们会提供极有价值的回报。\n\n缺乏胆识的收藏家请勿联络我们。\n\n请将此样本带到守护者的休憩并交给塔·娜茜。', '', '', '阴爪', '', '', '', 39653),
(63963, 'zhCN', '掮灵悬赏：裂殴', '从裂殴身上取得尖刺厚皮。', '新的陆地会带来新的机遇。致相关人士：如果有人能够从被称为“裂殴”的巨兽身上取得带刺的厚皮，我们会提供极有价值的回报。\n\n缺乏胆识的收藏家请勿联络我们。\n\n请将此样本带到守护者的休憩并交给塔·娜茜。', '', '', '裂殴', '', '', '', 39653),
(63962, 'zhCN', '观察记录', '从刻希亚的重殴者之台收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n重殴者之台的记录应该已经准备就绪，可以收集了。那些装置你是看不到的，但你能找到明亮的宝珠，那就是数据。\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(63961, 'zhCN', '封闭的秘密', '从刻希亚的重殴者之台取回$1oa个封起来的容器。', '啊，刻希亚。这里有怎样的秘密等待着揭示呢？\n\n我的同事们之前非常努力地在这里工作过，想要在这片破碎的大地上寻找有意思的小玩意。不过我向你保证，不会有什么特别重要的东西的。\n\n他们把那些东西保管在特制的箱子里，现在都在学者之家，等着你去发现。不用担心，所有的箱子都用牢不可破的封印锁住了，以保证里面的东西和携带箱子的人的安全。\n\n把那些封起来的容器带给我，我会给你合适的奖励的。', '', '', '', '', '', '', 39653),
(63960, 'zhCN', '观察记录', '从刻希亚的啸风之巢和觉醒河口收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n啸风之巢和觉醒河口的记录应该已经准备就绪，可以收集了。你看不到那些装置，但你能找到明亮的宝珠，那就是数据。\n\n也别忘记探查地下！\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(63959, 'zhCN', '观察记录', '从刻希亚的指引圣地收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n指引圣地的记录应该已经准备就绪，可以收集了。那些装置你是看不到的，但你能找到明亮的宝珠，那就是数据。\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(63958, 'zhCN', '观察记录', '从刻希亚的宝库外面收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n宝库外围的记录应该已经准备就绪，可以收集了。那些装置你是看不到的，但你能找到明亮的宝珠，那就是数据。\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(63957, 'zhCN', '观察记录', '从刻希亚的求知者议事堂收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n求知者议事堂的记录应该已经准备就绪，可以收集了。那些装置你是看不到的，但你能找到明亮的宝珠，那就是数据。\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(63956, 'zhCN', '封闭的秘密', '从刻希亚的啸风之巢取回$1oa个封起来的容器。', '啊，刻希亚。这里有怎样的秘密等待着揭示呢？\n\n我的同事们之前非常努力地在这里工作过，想要在这片破碎的大地上寻找有意思的小玩意。不过我向你保证，不会有什么特别重要的东西的。\n\n他们把那些东西保管在特制的箱子里，现在都在学者之家，等着你去发现。不用担心，所有的箱子都用牢不可破的封印锁住了，以保证里面的东西和携带箱子的人的安全。\n\n把那些封起来的容器带给我，我会给你合适的奖励的。', '', '', '', '', '', '', 39653),
(63954, 'zhCN', '封闭的秘密', '从求知者议事堂取回$1oa个封起来的容器。', '啊，刻希亚。这里有怎样的秘密等待着揭示呢？\n\n我的同事们之前非常努力地在这里工作过，想要在这片破碎的大地上寻找有意思的小玩意。不过我向你保证，不会有什么特别重要的东西的。\n\n他们把那些东西保管在特制的箱子里，现在都在学者之家，等着你去发现。不用担心，所有的箱子都用牢不可破的封印锁住了，以保证里面的东西和携带箱子的人的安全。\n\n把那些封起来的容器带给我，我会给你合适的奖励的。', '', '', '', '', '', '', 39653),
(63951, 'zhCN', '阴暗之地', '使用不平衡的裂隙石进入裂隙，破坏隙掩陷阱解救$1a名隙缚沃卡伊。', '存在可并不简单，$p，它是由层层现实堆叠成的。\n\n典狱长的陷阱正把我们的士兵拉入一个常人难以窥见的裂隙当中。\n\n我得到了一个不平衡的裂隙石。它能帮助你进入裂隙，并在士兵们永远迷失之前，摧毁那些将他们困在里面的陷阱。\n\n当你将隙掩陷阱摧毁完毕后，离开裂隙并将那些受困的士兵带回我们的现实当中。', '', '', '', '', '', '在俯瞰黑暗滋长的桥头与辛达妮侯爵会面。', 39653),
(63950, 'zhCN', '刀翼兽之爪', '收集$1oa个刀翼兽之爪。', '我的猎人们还不太熟悉这片土地，但我们发现这里栖息着强大的野兽。\n\n其中就有刀翼兽，这些恶毒的掠食猛兽长着可怕的利爪……还有着沃卡伊的暴脾气。\n\n<赫尔恩咧开了嘴。>\n\n给我带一些他们的利爪来，让我们新来的猎人们学学，他们将会遭遇怎样的野兽。', '', '', '', '', '', '', 39653),
(63949, 'zhCN', '塑造命运', '在刻希亚和噬渊完成盟约突袭和日常任务、打开宝藏、消灭稀有生物、或者击败托加斯特的折磨者，挫败典狱长的势力。', '典狱长的力量和恶意仍在扩张，我们的应对能力也应加强。\n\n与你的盟友并肩同行，$n，击退企图将我们尽数吞噬的黑暗。\n\n齐心协力，我们终将胜利。\n\n愿天命指引你的双手。', '', '', '', '', '', '', 39653),
(63944, 'zhCN', '刻希亚在等待', '向刻希亚的守护者的休憩的塔尔-加兰报告。', '做好准备，$n，我们的盟友在刻希亚等待着你。', '', '', '', '', '', '', 39653),
(63936, 'zhCN', '被吞噬的心能', '从觉醒河口的吞噬者身上收集$1oa份被吞噬的心能。', '西卡有个主意！\n\n吞噬者们……会吞噬。它们什么都吃！也吃心能。\n\n如果我们抢走吞噬者的心能，心能就归我们了！', '', '', '', '', '', '', 39653),
(63935, 'zhCN', '宝贵的根须', '从刻希亚的宝库附近收集$1oa份残存的心能。', '刻希亚，姐妹般的森林，饱经创伤磨难。\n\n但在毁灭的痛楚中，仍会萌发出希望。\n\n收集心能，重建一新。', '', '', '', '', '', '', 39653),
(63934, 'zhCN', '邮件问题', '从学者之家取回$1oa份失窃的信息。', '幸会，凡人！\n\n我正在执行任务，为刻希亚的盟友们传达信息。不过嘛，我没能完成自己的任务。\n\n我本该传递的信息都被渊誓者窃取了，随后错误地散落在各处。\n\n你能否收集信息再交还给我？我一定会将它们送到原定接收人手中。\n\n谢谢你！', '', '', '', '', '', '', 39653),
(63924, 'zhCN', '高莱克利爪神像', '将高莱克利爪神像带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个神像留出了位置。>', '', '', '', '', '', '', 39653),
(63923, 'zhCN', '朗氏木雕', '将朗氏木雕带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个木雕留出了位置。>', '', '', '', '', '', '', 39653),
(63922, 'zhCN', '切影短剑', '将切影短剑带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这把短剑留出了位置。>', '', '', '', '', '', '', 39653),
(63921, 'zhCN', '镜像戒指', '将镜像戒指带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个戒指留出了位置。>', '', '', '', '', '', '', 39653),
(63920, 'zhCN', '神秘的解密装置', '将神秘的解密装置带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个装置留出了位置。>', '', '', '', '', '', '', 39653),
(63919, 'zhCN', '束缚之书：被折磨的巫师', '收集$1oa张蔚蓝书页，将它们带给追忆圣窟的档案员罗-遂尔。', '<你听到这本书中传来了一个沉闷的声音，话语中还夹杂着噼啪的杂音。尽管说话的内容几乎难以听清，但你还是理解了大致意思，它反复请求你找回蔚蓝书页。\n\n你在宝典中草草翻阅，发现许多书页都已缺失。\n\n如果能取回书页并交给档案员，这本书也许就能重新组合。>', '', '', '', '', '', '', 39653),
(63918, 'zhCN', '恐怖音讯方尖碑', '将恐怖音讯方尖碑带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个方尖碑留出了位置。>', '', '', '', '', '', '', 39653),
(63917, 'zhCN', '永生雕像', '将永生雕像带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个雕像留出了位置。>', '', '', '', '', '', '', 39653),
(63916, 'zhCN', '奇壤之袋', '将奇壤之袋带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这些土壤留出了位置。>', '', '', '', '', '', '', 39653),
(63915, 'zhCN', '死神之鼓', '将死神之鼓带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这面鼓留出了位置。>', '', '', '', '', '', '', 39653),
(63914, 'zhCN', '领悟密文', '将领悟密文带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个密文留出了位置。>', '', '', '', '', '', '', 39653),
(63913, 'zhCN', '不稳定的爆裂宝珠', '将不稳定的爆裂宝珠带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这个装置留出了位置。>', '', '', '', '', '', '', 39653),
(63912, 'zhCN', '天辰暗影界星图', '收集$1oa个生后导航研究卷轴，将它们带给追忆圣窟的档案员罗-遂尔。', '<你认出了这件属于档案员卷宗的圣物。\n\n渊誓者认为它毫无用处，于是随手丢弃了。\n\n缺少了与其相匹配的数据来确定暗影界冥世的相对方位，这张星图确实派不上用场。如果能从死去的学者身上取回研究成果，星图就能在档案员手中充分发挥作用了。>', '', '', '', '', '', '', 39653),
(63911, 'zhCN', '吟钢锭', '击败渊誓入侵者，将吟钢锭带给追忆圣窟的档案员罗-遂尔。', '<钢锭以颤抖的声音嚎哭不止。>\n\n哎呦！那些恶棍毫不留情地锤打我，扭曲了我的身体，来满足他们的邪恶企图。\n\n呸！我唾弃他们。\n\n<钢锭发出了一声尖锐的战吼。>\n\n让渊誓者尝尝被锤打的滋味！', '', '', '', '', '', '', 39653),
(63910, 'zhCN', '扭曲虚空之星', '为扭曲虚空之星充能，将它带给追忆圣窟的档案员罗-遂尔。', '<你认出了档案员卷宗中的圣物。\n\n能量源几乎已经枯竭，但只要暴露在未经过滤的原生心能中，就可以恢复它的能量。附近的裂隙显然符合要求。>', '', '', '', '', '', '', 39653),
(63909, 'zhCN', '拟态者的伪装', '将拟态者的伪装带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这副面具留出了位置。>', '', '', '', '', '', '', 39653),
(63908, 'zhCN', '神圣意图壁垒', '将神圣意图壁垒带给追忆圣窟的档案员罗-遂尔。', '<你很熟悉档案员卷宗，很快就认出了这是丢失的圣物之一。\n\n档案员罗-遂尔在追忆圣窟中为这面盾牌留出了位置。>', '', '', '', '', '', '', 39653),
(63904, 'zhCN', '炽蓝仙野之心', '调查森林之心。', '我将印记藏在了森林之心，使噬渊的军队无法染指。\n\n但求援的号角已经吹响。\n\n你和盟友们必须尽快赶去，看看号角为何而响。', '', '', '', '', '', '返回森林之心外的寒冬女王身边。', 39653),
(63903, 'zhCN', '强袭圣所', '在统御圣所中击败希尔瓦娜斯·风行者。', '典狱长夺得了全部四个盟约的印记，他显然企图逃出噬渊，在奥利波斯夺取仲裁官的印记。\n\n我们绝不能坐视此事发生。\n\n托加斯特的顶部就是统御圣所，那是典狱长的力量之源。挺进这个黑暗领域的时刻终于到来了。\n\n希尔瓦娜斯·风行者肯定会统率部队阻挠我们。我们必须击败她……再将安度因·乌瑞恩从她的魔掌中救出。\n\n集结你的军队，$n。黑锋骑士团与你同在。', '', '女妖之王就是典狱长计划的关键。找到她……阻止她。', '希尔瓦娜斯·风行者', '', '', '', 39653),
(63902, 'zhCN', '喜讯，各位！', '与丹妮卡一同飞往刻希亚，将消息告知伯瓦尔。', '来吧，朋友，我们赶紧摆脱这个糟糕的地方。\n\n你的战友肯定想要得知典狱长之眼落败的消息。我这就把你送过去。\n\n准备好出发了就告诉我，$n。', '', '', '', '', '', '', 39653),
(63901, 'zhCN', '眼目聚焦', '前往终点平台，使用伊尔斯卡号角召唤奥丁之怒。', '你采集到的悲伤和愤怒经过了混合，能够满足你的需求了。大概吧。\n\n如果你坚持要进行这个不明智的尝试，那就前往终点平台使用号角吧，那里是聚魂之河向上流入托加斯特的地方。那儿的能量确实非常强大。\n\n你那金色盟友的出现会吸引典狱长的眼睛，但愿这不会成为你的末日。我可不想看到一项投资白白浪费。', '', '典狱长之眼在噬渊中搜寻着典狱长的敌人。', '典狱长之眼', '', '', '', 39653),
(63899, 'zhCN', '束缚之书：疯狂女巫', '收集$1oa张猩红书页，将它们带给追忆圣窟的档案员罗-遂尔。', '<你听到这本书中传来了一个沉闷的声音，话语中还夹杂着噼啪的杂音。尽管说话的内容几乎难以听清，但你还是理解了大致意思，它反复请求你找回猩红书页。\n\n你在宝典中草草翻阅，发现许多书页都已缺失。\n\n如果能取回书页并交给档案员，这本书也许就能重新组合。>', '', '', '', '', '', '', 39653),
(63896, 'zhCN', '受诅者之泪', '从戈尔格亚：聚魂之河中收集$1oa份受诅者之泪。', '为了将乐器与噬渊相连并让其能够发挥出你所希望的效果，必须将原始的、未经过滤的痛苦注入其中，而那些痛苦来自于被困在这个诅咒监狱中的灵魂。\n\n这里充斥着悲伤，因此想要收集并不困难。你只需要去戈尔格亚走一趟，当被诅咒者被聚魂之河席卷而走时，那些潸然落下的泪水都是悲伤的结晶。\n\n注意别让他们的悲伤淹没了你。', '', '', '', '', '', '把受诅者之泪带给戈尔格亚边缘处的威·娜莉的投影。', 39653),
(63895, 'zhCN', '翻袋掏兜', '测试从威·娜莉的袋子中取出的传送装置。', '有意思……听觉定序器和虚渺斗篷。好好收着吧，$n，我猜它们早晚都能派上用场。\n\n啊，还有一件特殊的东西。如果我没弄错的话——我也基本不会弄错——这是一个投射装置，非常便利！\n\n这又是什么？某种传送装置，我们应该立刻测试一下。\n\n“我们”指的当然是你。', '', '', '', '', '', '', 39653),
(63892, 'zhCN', '占卜者的符文短棒', '收集$1oa根符文短棒，将它们带给追忆圣窟的档案员罗-遂尔。', '<包裹内孤零零地放着一根符文短棒，似乎有只看不见的手在翻动它、旋转它。\n\n与维库语隐约相似的符文被精心地刻写在石头上。从短棒的背面可以看出，它是一整套中的一根。>', '', '', '', '', '', '', 39653),
(63867, 'zhCN', '愤怒掌控', '在聚魂之河使用虹吸装置从狂怒影魔身上吸取愤怒。', '尽管我花了很多时间欣赏塔扎维什的娱乐表演，但我并非音乐家。\n\n要让这个号角发出声音，就需要取得强烈的情感。\n\n聚魂之河中徘徊着许多受到诅咒的不幸者，他们心中的愤怒从未平息。使用这个虹吸装置，从这些狂怒影魔身上吸取情感，然后送入你的乐器吧。\n\n你采集到的狂怒尖啸应该能让你穿透噬渊，达到你的盟友那里。\n\n不过我觉得这首曲子可能不会那么受欢迎。', '', '', '', '', '', '在聚魂之河旁边找到威·娜莉的投影。', 39653),
(63864, 'zhCN', '恐怖的混合物', '熄灭$2oa个不稳定的余烬火花。', '墓穴之尘和点刻之草混合起来会释放出非常恐怖的味道，塔宾斯使用这个材料组合调配了大量的茶。\n\n当时太恐怖了，我把整壶茶都扔进了火里，但没想到这种茶湿度极高，是很好的灭火剂！\n\n塔宾斯会把整批茶都带给你。好好使用吧，我指的是把茶丢进佐瓦尔的坩埚附近的不稳定的余烬火花上。', '', '', '', '', '', '', 39653),
(63863, 'zhCN', '团结于骄傲下', '击败玛尔菲斯图斯、多莫努斯和弗雷斯。', '尽管存在竞争分歧，但是在面对巨大威胁时，涅美娅和我会齐心协力战斗。在战场上，翼狮和灵豹都是勇猛的斗士。\n\n我们都很荣幸能够在即将到来的战斗中为你提供协助。\n\n请允许安蒂拉或加塔马托斯协助你击败威胁到我方部队的典狱长勇士。', '', '', '', '', '', '', 39653),
(63861, 'zhCN', '收集的开端', '为追忆圣窟的档案员罗-遂尔取回记忆宝典。', '我们必须继续努力，找回学术研究中最重要的物品——失落的宝典。\n\n这会花上不少时间，但随着我们不断取得进展，它的内容也会不断增加和丰富，正如刻希亚在无数个纪元中逐渐壮大一样。\n\n至于它的位置，它此前被藏在刻希亚深处的沉思洞窟中，就在此地的南方。\n\n但愿典狱长的爪牙还没有找到它。', '', '', '', '', '', '', 39653),
(63860, 'zhCN', '永恒学者的护符', '将受损的护符带给追忆圣窟的档案员罗-遂尔。', '<护符上布满了凹痕和污泥。将它放在这里的人对待它相当粗暴草率。\n\n档案员罗-遂尔在追忆圣窟中为这个护符留出了位置。>', '', '', '', '', '', '', 39653),
(63857, 'zhCN', '永恒者之声', '聆听计划。', '<伯瓦尔凝视着面前的宏伟景象，看着无数个传送门层层叠叠，延伸至虚无空中。>\n\n这间密室……真是奇异壮丽。\n\n但我们无暇赞叹了，尊崇之声必须立刻召开会议。', '', '', '', '', '', '返回奥利波斯的飞地。', 39653),
(63856, 'zhCN', '盟约集会', '与塔尔-伊纳拉交谈以进入仲裁官密室。', '虽然典狱长依然被束缚在噬渊之中，他的暴行早已越过了其所在的牢笼。\n\n谢天谢地，执政官已经从袭击中恢复了过来。但我听说她的创伤似乎……令人不安。\n\n永恒者与他们的盟友正在仲裁官密室中等待你和大领主弗塔根。我这就打开通路。\n\n我的话即是她的意志。', '', '', '', '', '', '', 39653),
(63855, 'zhCN', '畅通无阻', '在刻希亚和威·娜莉的庇护所之间建立通路。', '刻希亚充满了机遇，瞧瞧，有这么多激动人心的发现呢。\n\n我知道会有如此奇景，这次可是有备而来。我们要找一个合适的地点，在这里和我的庇护所之间建立永久的通路。\n\n我们的合作还没有结束。', '', '', '', '', '', '', 39653),
(63853, 'zhCN', '消灭烈焰', '为西塔尔消灭无穷者因弗努斯。', '你看见它了吗？\n\n就在我余光所及之处，一直都在……还闪耀着明亮的光！\n\n如果火焰和灰烬的化身在附近，人们怎么能放松下来享受美味的茶呢？\n\n拜托了，噬渊行者，帮我一个忙……干掉它，这样我们就能好好品品我最爱的混和茶了！', '', '就像佐瓦尔的坩埚那里的熔炉一样，它的火焰永远不会熄灭。', '无穷者因弗努斯', '', '', '', 39653),
(63849, 'zhCN', '助听效用', '在渊狱中放置听觉定序器，帮助威·娜莉窃听其中的住民。', '真是幸运！你碰巧传送到了一个我非常……感兴趣的地方。把我交给你的听觉定序器放置好，我会试着建立有效的信号。\n\n在如此危险的地方一定要谨言慎行，你可以使用虚渺斗篷隐蔽身形。', '', '', '', '', '', '', 39653),
(63848, 'zhCN', '感激的证明', '在刻希亚的守护者的休憩与威·娜莉交谈。', '你的出现证明了古老预言的应验，噬渊行者。我相信你和你的盟友定能拯救我们。\n\n也许我对你的掮灵朋友太过苛刻了，毕竟是她送你来到刻希亚的。\n\n请替我们向威·娜莉表示感谢，告诉她我们很乐意回答她的疑问。\n\n她……看起来满腹疑问。', '', '', '', '', '', '', 39653),
(63845, 'zhCN', '奥丁之怒', '见证选召瓦格里的强化和伊尔斯卡号角的联结。', '号角已经铸成，杰出勇士已经列于阵前。\n\n现在，$n，我们只需要将选召的瓦格里与号角联结，为其注入我的力量，使其得以施展我的愤怒。\n\n来吧，见证吧。', '', '', '', '', '', '', 39653),
(63844, 'zhCN', '选召之众', '进入荣耀之环，与瓦格里作战，选拔杰出者。', '在未来的战斗中，我需要更多瓦格里与丹妮卡同行。$n，我赐予你甄选杰出者的荣誉。\n\n最强大的勇士会在荣耀之环的挑战中证明自己。奋勇拼搏，$c，不负手中武器之荣耀。', '', '', '', '', '', '', 39653),
(63842, 'zhCN', '不错的计谋', '在特玛库伦缩小15名敌人，并放大$2oa只噬渊鼠吃掉他们！', '这些残忍的折磨者让我怒不可遏……\n\n典狱长手下的恶棍折磨着被不公正地送到此处的善良灵魂，因为没有人敢反抗他们！\n\n现在我来了，我有个能让他们付出代价的完美计划。\n\n如何？你想不想帮我逆转现在的形势？', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63840, 'zhCN', '它们长得太快了', '给戈姆蛴喂食尸体，然后骑上它走向胜利！', '我知道你在想什么，但我完全控制住了这些戈姆蛴！\n\n我在温西尔的灰烬王庭学到了一两个诀窍，能够抑制并控制住这些麻烦精。\n\n如果你想利用它们的力量为我们的战斗提供帮助，我就把我的法杖借给你。你可以用法杖选择一个戈姆蛴，然后命令它吃掉敌人的残骸，增强它的力量并增大它的体型。\n\n不需要太多残骸。戈姆蛴长得非常快。', '', '', '', '', '', '在特玛库伦的戈姆兽栏附近与雷尔多恩会面。', 39653),
(63839, 'zhCN', '哪怕找到一个也值得', '在特玛库伦检查低劣之魂，直到找到一个真正的杰出之魂。', '我亲眼看见一些杰出之魂被不公正地扔进噬渊。\n\n格雷希特差一点就被宫务大臣的手下毁掉了。在我的照顾下，他已经充分地证明了自己。\n\n去看看那些被典狱长的走狗定性为“低劣”的灵魂。每个都检查一下，确认他们是否应该落得如此下场。\n\n在特玛库伦我们检查的所有灵魂当中，哪怕只找到一个能带回雷文德斯的杰出之魂也是值得的。', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63837, 'zhCN', '万能的茶', '帮助塔宾斯和加宾斯，为特玛库伦中的$2oa名盟友送茶。', '我亲爱的$p！我就知道你会及时赶到，把我们从无聊的边缘拯救出来！\n\n我刚刚和尼娅讲过你在灰烬荒野的事迹，就是你用一杯能够恢复力量的茶救我的那次！\n\n她有一点怀疑。也许你能帮塔宾斯和加宾斯展示给她看看，那些都是真的！', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63836, 'zhCN', '裂牙粉丝俱乐部', '消灭$1oa名裂牙从传送门拖过来的托加斯特敌人。', '裂牙是我见过的最强壮的泥仆！简直不可思议！\n\n他就在那，把手伸进那个巨大的托加斯特传送门，然后把坏家伙们从家里拖过来！\n\n而那些被拖过来的家伙往往根本不知道究竟发生了什么，哈哈！\n\n等我和棍脸到了那里，我们也会加入他的粉丝俱乐部。\n\n你也来吗？那你需要和其他人一样赢得资格才行。去传送门那，与裂牙拖过来的敌人战斗！', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63835, 'zhCN', '聚会通报官的怒火', '帮助聚会通报官泰梅尔向特玛库伦中的$2oa名敌人投掷毒液炸弹。', '噢，你这么快就回来了，$p！\n\n……还是说我们从没见过？有时候要分清楚真的很难……\n\n不管怎么说，我相信你在地穴看守者卡希尔削弱对手的计划方面取得了进展。\n\n我不知道计划的细节，但我确定泰梅尔参加了这个计划。我最近听说他自诩为“聚会通报官”……\n\n<照管者向远方看了一会儿。>\n\n“聚会通报官”吗……我一定是离开雷文德斯太久了。', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63834, 'zhCN', '特玛库伦的武器', '收集$1oa件渊誓武器、$2oa顶幽灵王冠和$3oa只影眼。', '堕罪堡的温西尔从不浪费灵魂，她的石裔也从不浪费装备。\n\n回收敌人的工具，这样我们就可以将它们归为我方军队所用。', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63833, 'zhCN', '为特玛库伦带来恐惧', '在特玛库伦消灭$1oa名敌人。', '我确信我的同胞和将军们需要你的帮助，他们有更为特殊的任务。\n\n但我的任务很简单。现在我们四面八方都是敌人。\n\n去将他们击退，为我们赢得更多的活动空间。', '', '', '', '', '', '与隐藏在特玛库伦阶梯下的雷纳索尔王子会面。', 39653),
(63831, 'zhCN', '愤怒的呐喊', '在奥丁的熔炉中协助锻造大师海尔加。', '胆敢袭击我的瓦格里，我将回以无情的狂怒！\n\n你将在其中发挥关键作用，$c。你必须如今日一般振作勇气，才能吸引我的眼睛与你一战。\n\n但是首先，有一个简单的任务……铸造号角来召唤我的愤怒。锻造大师海尔加将会指导你。', '', '', '', '', '', '', 39653),
(63829, 'zhCN', '无人飘浮', '已解救$1oa名被困的候选者。', '机会来了，我们现在可以解救那些我们本以为牺牲了的同伴！\n\n典狱长抓走了我们许多的候选者来补充他的部队。他把那些反抗者都关进了飘在我们上方的那些笼子中，任由他们的灵魂彻底破碎。\n\n打碎统御之链，从笼子中解救被困的候选者吧。', '', '', '', '', '', '', 39653),
(63827, 'zhCN', '鼓舞的言语', '为$1oa名筋疲力竭的防御者背诵圣典中的文字。', '我们的部队已经连续战斗了好几个小时，真残酷。毫无疑问，他们现在身心俱疲。\n\n拿上这本圣典，为士兵们背诵里面的文字吧。别被假象蒙骗，这篇文字可能听起来意义不明，但其中却蕴含着巨大的力量。\n\n听到这些文字，筋疲力竭的防御者就能重获活力和希望。', '', '', '', '', '', '', 39653),
(63824, 'zhCN', '格里恩突袭', '在破灭堡和湮灭真容完成$1oa个任务。', '典狱长的部队被我们的攻击打了个措手不及。我们要趁势拿下破灭堡，击败他位于统御祭坛的勇士！\n\n我们需要你的帮助，噬渊行者。在战场上协助我们的部队！', '', '', '', '', '', '', 39653),
(63823, 'zhCN', '法夜突袭', '在破灭堡和湮灭真容完成$1oa个任务。', '典狱长的部队被我们的攻击打了个措手不及。我们要趁势拿下破灭堡，击败他位于统御祭坛的勇士！\n\n我们需要你的帮助，噬渊行者。在战场上协助我们的部队！', '', '', '', '', '', '', 39653),
(63822, 'zhCN', '温西尔突袭', '', '', '', '', '', '', '', '', 39653),
(63811, 'zhCN', '愤恨交织', '与丹妮卡一同前往蜜酒大厅，将海拉的行径告知奥丁。', '当第一名姐妹失踪时，我们都忧心忡忡。派去寻找她的人再未归来，后续的搜寻者也音讯全无。\n\n而我们发现的，是曾经信赖之人的无情背叛。\n\n来吧，必须将我们在噬渊中所目睹的一切告诉奥丁。\n\n他必定会怒不可遏。', '', '', '', '', '', '', 39653),
(63810, 'zhCN', '鸟以群分', '跟随金色羽毛的踪迹，找出羽毛的来源。', '我在噬渊中见过许多漆黑的羽翼，却从未看到过闪亮的金色羽毛。\n\n既然听觉定序器已经能够稳定地传输信息，我们现在应该去查明这些羽毛的来源了。\n\n循着踪迹走，噬渊行者。这里深埋着秘密……也许还很有赚头。\n\n你的世界以金为贵，不是吗？', '', '', '', '', '', '', 39653),
(63794, 'zhCN', '掮灵悬赏：饥渴的巨兽', '从一只饥渴的巨兽身上取回大量吞噬者之血。', '新的陆地会带来新的机会。如果有相关人士能够带来大量吞噬者之血，最好是从巨兽身上获取的，我们会提供极有价值的回报。\n\n缺乏胆识的收藏家请勿联络我们。\n\n请将此样本带到守护者的休憩交给塔·娜茜。', '', '', '饥渴的巨兽', '', '', '', 39653),
(63793, 'zhCN', '掮灵悬赏：亵渎者恩席迪乌斯', '击败亵渎者恩席迪乌斯。', '有一位生有双翼的渊誓者，亵渎者恩席迪乌斯，正在阻碍着财团在刻希亚的行动。\n\n谁能够消灭那个恶徒，就能得到丰富的奖赏。\n\n多加小心，恩席迪乌斯是个强大的敌人，要击败他你可能需要几名盟友。', '', '', '亵渎者恩席迪乌斯', '', '', '', 39653),
(63792, 'zhCN', '掮灵悬赏：拆解者诺克图努斯', '击败拆解者诺克图努斯。', '一个臭名昭著的噬渊法师，拆解者诺克图努斯，正在阻碍着财团在刻希亚的行动。\n\n谁能够消灭那个恶徒，就能得到丰富的奖赏。\n\n多加小心，诺克图努斯是个强大的敌人，要击败他你可能需要几名盟友。', '', '', '拆解者诺克图努斯', '', '', '', 39653),
(63791, 'zhCN', '掮灵悬赏：咒裔者瓦尔迪纳', '击败咒裔者瓦尔迪纳。', '咒裔者瓦尔迪纳，一位身披尖刺重甲的渊誓者，正在阻碍着财团在刻希亚的行动。\n\n谁能够消灭那个恶徒，就能得到丰富的奖赏。\n\n多加小心，瓦尔迪纳是个强大的敌人，要击败他你可能需要几名盟友。', '', '', '咒裔者瓦尔迪纳', '', '', '', 39653),
(63790, 'zhCN', '掮灵悬赏：领主阿佐拉克', '击败领主阿佐拉克。', '领主阿佐拉克，一个强大的恐惧魔王，正在阻碍着财团在刻希亚的行动。\n\n谁能够消灭那个恶徒，就会得到丰富的奖赏。\n\n多加小心，阿佐拉克是个强大的敌人，要击败他你可能需要几名盟友。', '', '', '领主阿佐拉克', '', '', '', 39653),
(63789, 'zhCN', '深入行动：学者之家', '清除学者之家的渊誓者。', '我们不能让渊誓者在我们的营地附近占据立足点。侍神者们说，这地方始终隐蔽在他们的视线之外，但我一看到他们就没法安心。\n\n进入学者之家，清除典狱长的部队。', '', '', '', '', '', '', 39653),
(63788, 'zhCN', '深入行动：指引圣地', '清除指引圣地的吞噬者。', '侍神者的家园已经被典狱长所毁，但我们可以在危难关头伸出援手。\n\n指引圣地就在附近，他们谈及此地时总是满怀虔敬和悲伤。这是他们祈祷和追寻真理的地方，现在却充斥着吞噬者。\n\n清除吞噬者，让他们得以再次从仪式和祷告中寻获慰藉。', '', '', '', '', '', '', 39653),
(63787, 'zhCN', '深入行动：重殴者之台', '清除重殴者之台的碎皮熊。', '我的眼睛告诉我，重殴者之台就在噬渊通往刻希亚的新道路附近，那里会提供绝佳的战术和战略优势。\n\n不幸的是，那里到处都是碎皮熊。\n\n如果我们能占领那里，就能获得通往西方的道路，还能在观察点上监控典狱长的部队。', '', '', '', '', '', '', 39653),
(63786, 'zhCN', '横扫啸风之巢', '前往啸风之巢，清除区域中的敌对生物。', '刻希亚的天空危机四伏。\n\n不仅渊誓者威胁着我们的军队，当地的物种也敌意明显。为了空中的盟友和战兽，我们必须保证空域的安全。\n\n本地飞行生物聚居在啸风之巢。前往那里，荡平有进攻意向的物种的老巢。\n\n这样我们才能掌握制空权。', '', '', '', '', '', '', 39653),
(63785, 'zhCN', '深入行动：求知者议事堂', '在刻希亚的求知者议事堂中击退典狱长的军队。', '佐瓦尔大军的袭击仍在摧残这些土地。\n\n我们必须向他们表明态度，表明我们绝不退让，$n。\n\n炽蓝仙野之力与你同在。', '', '', '', '', '', '', 39653),
(63784, 'zhCN', '钱不是问题', '抓获$1oa只褐色跃足兽。', '$p！你好吗？\n\n我们听说，这里有许多有趣的东西。\n\n看到那些鬼鬼祟祟的跳跳了吗？不太容易看清，对吧？它们披着闪闪发亮的毛皮，我和小子们可以用它们来躲避视线。你懂得，躲开老大之类的。\n\n我要你帮我抓几只跳跳，钱不是事儿，帮我活捉几只就好。', '', '', '', '', '', '', 39653),
(63783, 'zhCN', '心能回收', '从指引圣地的吞噬者身上取回$1oa份被吞噬的心能。', '我们在此地的战事需要源源不断的补给，兵员、物资和心能都需要。显而易见，心能的供给是最困难的，但我早已学会了灵活做事。\n\n附近就有一处充足的心能来源。吞噬者正在涌入指引圣地。它们不会像那些灵魂一样，被揍了就能吐出心能，但只要你足够强大，其实也可以做得到。你行吗？', '', '', '', '', '', '', 39653),
(63782, 'zhCN', '渊誓者仪式', '收集$1oa本渊誓魔典。', '渊誓者的部队中有许多施法者。他们的法术并不为我们所晓，也因此格外致命。\n\n我们必须了解他们的能力，才能构建起可靠的防御。我个人对其手段和仪式的好奇只能归于其次。\n\n追捕这些恶毒的施法者，把他们的魔典带回来。', '', '', '', '', '', '', 39653),
(63780, 'zhCN', '还施彼身', '收集$1oa个渊誓纹章。', '光是想到典狱长的军队在炽蓝仙野肆虐，我就气不打一处来！\n\n这种时候，我一定会有账算账。\n\n或者，让你帮忙算账！消灭那些渊誓者，把他们的纹章带回来，让我看看你干掉了几个。\n\n从哪儿收集的并不重要，只要是从渊誓渣滓身上摘下来的就行！', '', '', '', '', '', '', 39653),
(63779, 'zhCN', '常态之貌', '收集$1oa份神龛供品。', '$p，我们要帮助刻希亚的侍神者。他们在突然之间就遭受了巨大的损失。\n\n指引圣地就在附近，他们会在那里的神龛前献上贡品。自从渊誓者入侵以来，他们就没能进入圣地，也无法取回宝贵的贡品。\n\n如果你能收集贡品并带回来，也许就能让侍神者稍稍恢复往昔的生活。', '', '', '', '', '', '', 39653),
(63777, 'zhCN', '封闭的秘密', '从学者之家取回$1oa个封起来的容器。', '啊，刻希亚。这里有怎样的秘密等待着揭示呢？\n\n我的同伴们一直在此努力，想要在这片破碎的大地上寻找有意思的小玩意。不过我向你保证，不会有什么特别重要的东西的。\n\n他们把那些东西保管在特制的箱子里，现在都在学者之家，等着你去发现。不用担心，所有的箱子都用牢不可破的封印锁住了，以保证里面的东西和携带人的安全。\n\n把那些封起来的容器带给我，我会给你丰厚的奖励的。', '', '', '', '', '', '', 39653),
(63776, 'zhCN', '观察记录', '从学者之家收集$1oa份观察记录。', '你好，噬渊行者，有空聊聊吗？\n\n你肯定知道，我的财团在刻希亚各处悄悄安放了观察装置。但无法取回的数据一文不值，所以我们需要你的帮助。\n\n学者之家的记录应该已经准备就绪，可以收集了。那些装置你是看不到的，但你能找到明亮的宝珠，那就是数据。\n\n也别忘记检查地底的洞穴！\n\n把数据带回来，我就会给你丰厚的奖励。', '', '', '', '', '', '', 39653),
(63775, 'zhCN', '密文与秘钥', '在宝库和求知者议事堂外围取回$1oa个失窃的密文。', '刻希亚的知识宝库采取了重重安保措施，其原因不言自明。\n\n每个宝库都需要密文才能破解并关闭屏障。换句话说，它们就是解开每一个奥秘的钥匙。\n\n在宝库外围搜寻被渊誓者窃取的密文，把它们带来给我。我会保证让它们，还有它们背后的奥秘安然无虞。', '', '', '', '', '', '', 39653),
(63774, 'zhCN', '尸体的尴尬', '将$1oa个丧躯之魂带给前线缝合者，为他们打造新的身躯。', '看看我们周围，$p。无论你看向哪个方向，尸体都堆积如山。这些丧躯之魂迫切地想要重返战斗。\n\n我们可以使用他们的热情来扭转战局。\n\n在战场各处召集丧躯之魂，将他们带给尸堆旁的缝合者，给他们打造新的身躯！', '', '', '', '', '', '返回女男爵德拉卡身边。', 39653),
(63772, 'zhCN', '整翅待发', '协助破灭堡南门外的阿耳忒弥德及格里恩部队。', '格里恩部队前来协助突袭。他们保护了我们的侧翼，还会对破灭堡南门进行围攻。\n\n向阿耳忒弥德报告，并尽你所能帮助格里恩！', '', '', '', '', '', '', 39653),
(63764, 'zhCN', '攫取苍穹', '与丹妮卡一起飞往苍穹要塞的奥丁的大厅。', '我为逝去的姐妹们哀悼，心中所念的只有复仇。但我知道自己无力抗衡女巫的魔法或她的渊誓者大军。\n\n我们必须接受智慧的指引，尽快逃离此地。\n\n虽然囚禁令我虚弱不堪，但我还有力气载你离开这里。\n\n我们快走吧，朋友。', '', '', '', '', '', '', 39653),
(63763, 'zhCN', '化形千面', '将阿佐迪乌斯的徽记带给守护者的休憩的伯瓦尔·弗塔根。', '<尚有余温的阿佐迪乌斯的徽记仍然挂着狰狞的笑容。\n\n必须将命运撰写师遭劫的消息告知守护者的休憩的侍神者们。\n\n大领主弗塔根肯定想要知晓这一意料之外的威胁。>', '', '', '', '', '', '将徽记带给守护者的休憩的伯瓦尔·弗塔根。', 39653),
(63762, 'zhCN', '幻象之下', '使用命运撰写师的工具驱散幻象。', '命运撰写师收集了必要的物品，在这里创建了幻象，好在我们可以使用他的工具驱散幻象，揭露出他的所在。\n\n能见到一张友善的面孔，他一定很开心。\n\n我得说，你真是这次任务的好帮手，没有你我真的不行。', '', '', '', '', '', '', 39653),
(63761, 'zhCN', '十年不晚', '在指引圣地消灭$1oa个吞噬者。', '<刻希亚守护者身负重伤，难以言谈。>\n\n吞噬者……涌入圣地。我们势单力孤……\n\n责任……未尽。\n\n天命……我……\n\n<守护者的声音渐渐消散。>', '', '', '', '', '', '', 39653),
(63760, 'zhCN', '命运的回响', '在指引圣地的神龛令命运撰写师的工具共鸣。', '吞噬者涌入了这片区域，但我们的重点依然是寻找命运撰写师。\n\n在这里膜拜的侍神者会在神龛前留下供奉的心能。\n\n如果命运撰写师就在附近，你找到的工具就会产生共鸣。如果走运的话，它会让我们知道他去向了何方。', '', '', '', '', '', '', 39653),
(63759, 'zhCN', '另寻别处', '在刻希亚指引圣地的入口处与看护者卡-萨恩碰面。', '我相信命运撰写师一定是打算前往指引圣地，那是刻希亚的侍神者们的神圣之地。\n\n幸运的是，因为你随手捡垃圾的习惯，我们找到了命运撰写师的工具！\n\n这肯定能帮我们找到他，但我们首先要前往圣地。', '', '', '', '', '', '在刻希亚指引圣地的入口处与看护者卡-萨恩碰面。', 39653),
(63758, 'zhCN', '遍寻不及', '在求知者议事堂中搜寻失踪的命运撰写师。', '我是为了找到命运撰写师，或者寻得能够帮助我们找到他的线索才来到此处的。\n\n有证据表明他来过这里，还躲过了渊誓者的袭击。我唯一尚未搜寻的地方，就是废墟另一头的冥想室。\n\n我孤身返回求知者议事堂太过危险，你能帮我一把吗？\n\n我必须找到命运撰写师，这件事至关重要。', '', '', '', '', '', '', 39653),
(63757, 'zhCN', '掠夺掠夺者', '从渊誓者处取回$1oa件刻希亚神器。', '<渊誓者携带着一件刻希亚神器。\n\n虽然不清楚敌人要拿这种神器做什么，但你觉得守护者的休憩那里的侍神者会希望你把这些神器带回去。>', '', '', '', '', '', '', 39653),
(63756, 'zhCN', '折磨余生', '在求知者议事堂中营救$1oa名被折磨的侍神者。', '渊誓者在求知者议事堂中大开杀戒，侥幸生还的都被抓起来严刑拷打。\n\n我们必须尽力救出他们，也许其中有人见过命运撰写师。', '', '', '', '', '', '', 39653),
(63755, 'zhCN', '燃眉之急', '搜索刻希亚的命运撰写师。', '噬渊行者，一桩燃眉之急尚未得到解决。\n\n我们的命运撰写师失踪了，至今没有找到前来此地的路途，他之前原本应该在求知者议事堂现身的……\n\n<路途撰写师罗-威斯停顿了一下。>\n\n你能去寻找命运撰写师吗？许多侍神者都会在废墟附近的洞穴里躲避渊誓者。', '', '', '', '', '', '', 39653),
(63754, 'zhCN', '笼中之鸟', '从歇尔鲁恩处取回冥锻印记，并释放丹妮卡。', '保持安静，我们不能引起注意。\n\n我的许多姐妹们都已经逝去了，我很快也会在女巫的邪恶仪式中丧命。\n\n把我从牢笼里释放出来，我能让我们都安全地离开。必须将这一场可耻的背叛告知守护者奥丁！\n\n能够释放我的印记在一个叫歇尔鲁恩的渊誓者手上，她就在附近的大厅中。', '', '', '掠心者歇尔鲁恩', '', '', '', 39653),
(63740, 'zhCN', '专家商讨', '与档案员的纪念碑沟通。', '我们可以修复脉蕴法杖，但这需要档案员们的智慧。\n\n不只是我，还需要旧世的档案员，他们的安息之所就在附近。刻希亚遭到了大规模破坏，而且破坏很可能继续，在纪念碑彻底损毁之前，我们也许还有最后一次走访的机会。\n\n走访档案员的纪念碑，也带上罗-遂尔，在那些讯息失落之前让他把它们抄录下来。', '', '', '', '', '', '', 39653),
(63739, 'zhCN', '希望崛升', '与希望高地山顶的档案员罗-赛娜拉和学者罗-遂尔碰面。', '我们还有最后一件事情要做。\n\n到希望高地的巅峰来找我们吧。', '', '', '', '', '', '', 39653),
(63738, 'zhCN', '建立档案馆', '在守护者的休憩与学者罗-遂尔碰面。', '我会前去守护者的休憩，那里稍微安全一些。\n\n我们会在那里建立新的档案馆。\n\n等你准备好了，就到那里找我吧。\n\n希望我们还能仰仗你，我们以后还需要你的援助。', '', '', '', '', '', '', 39653),
(63737, 'zhCN', '寻法理之天命', '参与仪式，调谐脉蕴法杖。', '我们的努力终于带我们走到了这里。\n\n有了档案员们的全部智慧，以及一位$r$c的帮助，我们就能将脉蕴法杖和寻获的圣物调谐。\n\n倘若成功，我们就有能力重建档案馆了。\n\n我们神圣的事业也将继续。', '', '', '', '', '', '', 39653),
(63736, 'zhCN', '心能灌注', '为脉蕴法杖灌注心能。', '我们通常会为脉蕴法杖注入扭曲虚空之星的能量，那是另一件重要的圣物。\n\n遗憾的是，我们现在没法这么做。不过在紧要关头，也可以用心能作为替代。\n\n带上脉蕴法杖前往下方河口处，在被消灭的吞噬者周围挥舞法杖。\n\n法杖应该可以吸取它们的心能。', '', '', '', '', '', '', 39653),
(63734, 'zhCN', '碎裂的法杖', '取回脉蕴法杖的三块碎片。', '我别无选择，只能将脉蕴法杖的秘密托付于你。\n\n在诸如训练有素的档案员这样恰当的人手中，法杖能够发挥作用，从暗影界的冥界中找到重要圣物的所在。\n\n法杖被拆分成三块碎片，以确保其不会落入恶人之手。虽然入侵者找到了碎片，但他们还没有意识到碎片的重要性。\n\n找回法杖的碎片，它们分别落到了不同的渊誓者成员手中。', '', '', '', '', '', '', 39653),
(63733, 'zhCN', '杀出一条路', '击败$1oa名渊誓入侵者。', '虽然我厌恶暴力，更喜欢对冲突作出理性的回应，但现在我别无选择。\n\n为了让我和罗-遂尔安全撤离，你必须给入侵求知者议事堂的渊誓者来一次致命的打击。\n\n杀出一条路来，让我们逃脱。', '', '', '', '', '', '', 39653),
(63732, 'zhCN', '中断审讯', '营救档案员罗-赛娜拉。', '嘘……安静！\n\n如果被入侵者发现，我就和其他人一样只有死路一条了！\n\n<罗-遂尔疯狂地指着渊誓者的方向。>\n\n他们在拷问档案员！\n\n你必须想办法营救她，绝不能让渊誓者获得她知道的信息！', '', '这名拷问者真是又冷血，又可憎。', '审讯者曾奇', '', '', '', 39653),
(63731, 'zhCN', '研究刻希亚圣物', '找到学者罗-遂尔，进一步了解圣物。', '<你找到了一本撕碎的书籍，里面记载着之前保存在刻希亚的圣物。>\n\n书中的一个名字开始闪光。“罗-遂尔”。\n\n书在你的手中旋转，指向了“罗-遂尔”这个名字不停地闪烁的方向。\n\n也许这位罗-遂尔可以让你进一步了解你所发现的那些圣物。>', '', '', '', '', '', '', 39653),
(63728, 'zhCN', '密院追猎', '与伊瑟拉交谈了解更多信息，然后在智识塔陵找到胡恩·高岭。', '在幻梦之中，我预见泰兰德·语风是炽蓝仙野存亡的关键。\n\n法夜一直在搜寻和她一样的月夜战神。为了寻找他们，我们招揽了一位艾泽拉斯的远古盟友，胡恩·高岭。\n\n艾露恩的力量太过强大，任何凡人都无力承受，泰兰德也不行。我不知道她还能坚持多久。\n\n请容我稍作说明，随后你必须尽快赶去玛卓克萨斯找到胡恩。', '', '', '', '', '', '', 39653),
(63727, 'zhCN', '兵主归来', '在守护者的休憩中与兵主碰面，制定新的进攻方案。', '典狱长的图谋需要五个印记，其中四个已经落入了他的魔掌。\n\n但他愚蠢地让我们活了下来。他想要看着我们屈从于他的意志，而这将会招致他的灭亡。\n\n只要你愿意付诸行动，我们就仍有一线希望，还有可以补救的办法。\n\n来吧，我将和你们其余的部队会合，谋划下一轮攻势。', '', '', '', '', '', '在刻希亚与兵主交谈。', 39653),
(63726, 'zhCN', '破解印记', '与伯瓦尔交谈，讨论如何处理印记。', '兵主的印记被回忆魔法束缚着，这让我想起了你曾经遭遇过的某些事物。\n\n你在托加斯特的深处结识了一个惨遭囚禁的灵魂，并与那位“刻符者”结为盟友。他会取走你找到的回忆，帮助你将其铸成武器和护甲。\n\n也许他可以将印记从纠结的回忆中分离出来。\n\n这是我们获取印记的最好机会，但这个方法也同样危险。', '', '', '', '', '', '在托加斯特中与兵主交谈。', 39653),
(63725, 'zhCN', '深入宝库', '在刻希亚的宝库中取回兵主的印记。', '这里的破坏……势不可挡。\n\n<塔尔-加兰轻声地念诵着祷言。>\n\n心能流进了宝库的残骸，我们现在可以入内了。\n\n进去之后，我就能取回兵主的印记。\n\n请在宝库中展示出虔敬，这毕竟是个鲜少有人目睹的神圣之地。\n\n就连预言都未曾提及，会有活着的凡人得以窥见其中的奥秘。', '', '', '', '', '', '将兵主的印记带给刻希亚的伯瓦尔·弗塔根。', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63722, 'zhCN', '刻希亚守护者', '在绝密宝库附近营救3名记录守护者。', '我们在典狱长大军的攻势下快要支撑不住了。现在你来了，我们终于可以取得一些进展。\n\n我知道你的首要任务是进入宝库，但我们的几名记录守护者还流落在外，急需救援。\n\n他们对宝库中几乎所有的一切都了若指掌，我们不能让典狱长得到他们的信息。', '', '', '', '', '', '与绝密宝库中的剑斗士米维克斯碰面。', 39653),
(63717, 'zhCN', '守卫宝库', '帮助防御者卡-蕾芙击败入侵的渊誓者。', '想要到达宝库，我们得从进攻的渊誓者中清出一条路来。\n\n各盟约正在竭尽全力驱赶这些怪物，但他们无法一直这样撑下去。渊誓者意图抢在你之前拿到宝藏。\n\n我们需要你帮忙对抗典狱长的部队，噬渊行者。\n\n天命指引着我们。', '', '', '', '', '', '与绝密宝库中的剑斗士米维克斯碰面。', 39653),
(63714, 'zhCN', '前往宝库', '骑乘绽翼运输者前往绝密宝库', '骨匠将两个导灵器全部修好了，心能现在可以流入宝库了。现在我们有机会深入其中——只要能先走到跟前。\n\n玛卓克萨斯盟友已经叫来了载我们往返宝库的交通工具，我们最好尽快出发。\n\n如果典狱长的爪牙抢先夺走了兵主的印记，那么受难的就不只是刻希亚了，整个暗影界都可能沉沦。\n\n我们走，噬渊行者。部队还等着我们呢。', '', '', '', '', '', '与绝密宝库的防御者卡-蕾芙交谈。', 39653),
(63713, 'zhCN', '飞荡而过', '使用爪钩前往浮岛，并修复心能导灵器。', '我制作了一些牢固的爪钩和锚点。别担心——要是它们承得住我，那肯定承得住你！\n\n它们能让我们飞跃裂口，前往下一个心能导灵器所在之处。\n\n我先过去等你了，谁知道那头潜藏着什么东西呢？\n\n我们越早让心能导灵器运转起来，就能越快进入宝库，取获兵主的印记。', '', '', '', '', '', '', 39653),
(63712, 'zhCN', '失落的纪录', '使用矩阵道标，找回$2oa份失落的纪录。', '刻希亚被拖入噬渊的时候，有些记录守护者逃上了这座山。\n\n我还没有发现他们的踪迹，但也许他们留下了些纪录。\n\n带上这个道标，这是我用你之前救下的记录守护者提供的信息改装而成的。\n\n它会给你指路，帮你在山上找到完好的纪录。', '', '', '', '', '', '', 39653),
(63711, 'zhCN', '白骨工具', '从野生动物身上回收$1oa根灌注心能的骨头', '所以说，打开宝库的装置被放在了一座浮岛上？\n\n问题不大。\n\n我发现这地方有许多坚韧的生物。就像我一直说的，一根骨头也不要浪费！\n\n给我带一堆它们的骨头来，我要用它们打造几个钩射点，这样我们就能用爪钩爬上去了。', '', '', '', '', '', '', 39653),
(63710, 'zhCN', '心能踪迹', '跟随心能踪迹前往下一个导灵器。', '典狱长正在寻找兵主的印记。我们必须赶在渊誓者之前拿到它。要打开宝库，我们首先要用心能为它灌注力量。\n\n你帮助骨匠修复了第一个导灵器。心能所留下的痕迹就在前方，它们会指引我们找到下一个。\n\n如果我们能激活它，就会有足够多的心能流入刻希亚，使我们得以进入宝库。\n\n来吧，我们必须抓紧时间！', '', '', '', '', '', '在心能踪迹的末端与塔尔-加兰和骨匠海尔米尔碰面。', 39653),
(63709, 'zhCN', '宝库中的秘密', '与塔尔-加兰一同检视取回的纪录。', '真是太幸运了！你赶在渊誓者从他们口中得知宝库圣物的知识之前，救出了记录守护者。\n\n但这些信息支离破碎，并不完整。但愿还有足够的信息能够揭露真相。\n\n我会尝试将残存的记录整理成一条信息。如果天命正有此意，我们就能得知典狱长的目标，以及这件物品原本的归属。\n\n现在我必须集中精神，等你准备好了就告诉我。', '', '', '', '', '', '', 39653),
(63708, 'zhCN', '幻灭心能收藏家', '把扭曲幻灭心能带给威·娜莉的庇护所的威·娜莉。', '<古怪的异界能量微粒以诡异的节奏闪动着。\n\n威·娜莉也许会觉得蛮有意思。>', '', '', '', '', '', '', 39653),
(63706, 'zhCN', '让心能自由流动', '帮助骨匠海尔米尔修复心能导灵器。', '塔尔-加兰把局势和宝库的原理全都告诉了我，至少是学者当中说得比较清楚的。\n\n我们首先要确保宝库获得供能。他们在使用地下导灵器来供给心能。\n\n侍神者说，其中一个导灵器就藏在学者之家的某个洞穴里。\n\n你把我带到那里，我就能想办法修复它。在我鼓捣这些刻希亚装置的时候，你得盯好我的背后。', '', '', '', '', '', '', 39653),
(63705, 'zhCN', '知识守护者', '在学者之家营救$1oa名记录守护者。', '我们的宝库中存放着无穷无尽的秘密和神器。即使我们能够入内，也无法确信典狱长要找的是什么。\n\n有些侍神者担任了记录守护者一职，负责记录宝库中存放的物品。他们以谨小慎微而闻名。\n\n渊誓者俘虏了一些守护者，想用严刑拷打逼他们开口。\n\n救出那些记录守护者，$n。他们能帮我们辨明被流放者的意图！', '', '', '', '', '', '', 39653),
(63704, 'zhCN', '为刻希亚复仇', '在学者之家消灭$1oa个渊誓者。', '虽然打开宝库是我们的第一要务，但我得请你帮个忙。\n\n刻希亚被拖入噬渊的时候，我的人民都吓坏了。我们逃进了你眼前的这片区域，名为学者之家的祥和之地。\n\n渊誓者很快就盯上了我们，大多数同胞都惨遭屠戮，其他人则沦为俘虏。\n\n如果我有能力亲手复仇，我肯定别无二话，但我并不擅长战斗。而你不一样。\n\n我恳求你，让那些怪物明白，玷污刻希亚的罪行不可饶恕！', '', '', '', '', '', '', 39653),
(63703, 'zhCN', '绝密宝库', '在学者之家外与塔尔-加兰碰面。', '你帮助我们重建了些许秩序，噬渊行者，但前路依然黯淡。\n\n典狱长的部队对刻希亚外围的宝库遗迹发起了全面袭击。被流放者显然在寻找贵重之物。\n\n当建筑遭遇威胁时，宝库的防御就会激活，所以进入内部并非易事。但我们必须赶在渊誓者之前，找到典狱长觊觎的物品。\n\n我征召了一位通灵领主的协助，此人能帮我们打开宝库。', '', '', '', '', '', '与学者之家外的塔尔-加兰交谈。', 39653),
(63690, 'zhCN', '亚历山德罗斯·莫格莱尼的挚友', '', '', '', '', '', '', '', '', 39653),
(63688, 'zhCN', '米卡尼科斯的挚友', '', '', '', '', '', '', '', '', 39653),
(63683, 'zhCN', '寒冬印记', '将姐妹之泪带给森林之心的伊瑟拉。', '我的妹妹……这么之后……她都没有抛弃我……\n\n<一丝不易察觉的微笑在寒冬女王脸上转瞬即逝。她转过头来，带着无数个纪元的凝重注视着你。>\n\n跟我来，$n。带上我妹妹的泪水，到森林之心来。', '', '', '', '', '', '', 39653),
(63682, 'zhCN', '艾露恩的力量', '协助进行仪式。', '在仅有的时间里，我们已经竭尽所能了。\n\n现在我们必须将力量借给席尔纳克斯和其他人，希望泰兰德能够逃过一劫。', '', '', '', '', '', '', 39653),
(63681, 'zhCN', '重返森林之心', '返回炽蓝仙野森林之心前方的伊瑟拉身边。', '我们要尽快赶回炽蓝仙野！\n\n你去找伊瑟拉，我会护送锻石师前去，也会确保胡恩回程顺利。', '', '', '', '', '', '返回炽蓝仙野森林之心前方的伊瑟拉身边。', 39653),
(63680, 'zhCN', '悬崖勒牛', '追踪胡恩·高岭。', '胡恩似乎被带去了别处，是被锻石师亲自带走的！\n\n我们要在这个区域中寻找她的踪迹，希望这样就能找到胡恩！', '', '', '', '', '', '', 39653),
(63679, 'zhCN', '魔法奇幻之旅！', '在雷文德斯找到月莓女勋爵。', '<月莓女勋爵的声音从卷轴中响起。>\n\n$n！看来胡恩遇到麻烦了，而且，嗯，事情挺复杂的。我们需要你赶来雷文德斯帮忙！请快到统御要塞来找我。\n\n回见！', '', '', '', '', '', '在雷文德斯找到月莓女勋爵。', 39653),
(63678, 'zhCN', '阿卡莱克大仇得报', '在祭仪密院的埃索拉玛斯中与辛达妮侯爵碰面。', '害死阿卡莱克侯爵的最后一个叛徒也伏法了。\n\n虽然这无法让侯爵复生，但至少我很满意。\n\n女男爵希望我们把任务完成的消息通报给辛达妮侯爵，然后启程前往炽蓝仙野。', '', '', '', '', '', '在祭仪密院的埃索拉玛斯中与辛达妮侯爵碰面。', 39653),
(63677, 'zhCN', '死路一条', '在埃索拉玛斯中消灭法尔辛格。', '我的名单上还剩下最后一个名字，一个叫做法尔辛格的巫妖。\n\n辛达妮一直紧盯着他，想查明克尔苏加德的下一步密谋。\n\n她希望法尔辛格被严酷处决掉。\n\n我们可以在祭仪密院的埃索拉玛斯中找到他。', '', '消灭法尔辛格。', '法尔辛格', '', '', '', 39653),
(63676, 'zhCN', '无处可藏', '取回克尔苏加德的青睐徽记，并消灭德拉瓦奥拉。', '在克尔苏加德露出马脚之后，依然有人与他来往甚密。侯爵的陨落也与他们相关，他们休想逃过一死。\n\n我查明了其中一人，德拉瓦奥拉，但还有更多人隐藏着身份。辛达妮透露过，这些叛徒都携带着某种徽记。既然她也不知道具体有哪些人，我们就一边动刀，一边寻找。\n\n剩下的肯定会引以为戒。', '', '', '', '', '', '', 39653),
(63675, 'zhCN', '无路可逃', '收集线索并消灭泽尔玛尼。', '侯爵的陨落和泽尔玛尼脱不了干系。\n\n辛达妮相信，他一定会集结克尔苏加德的死忠，协助他进行下一步计划。\n\n我们要探查他的去向，再将他斩草除根。', '', '', '', '', '', '', 39653),
(63674, 'zhCN', '劳您大驾', '与兵主之座的瓦丝琪女士碰面，并请求卡莱克的协助。', '女男爵瓦丝琪女士给我指派了一个任务。只要有人相助，我就能干净利落地完成复仇。但她必须先批准你的协助，再允许我协助你的任务。\n\n前往兵主之座吧，我们要向她进言。', '', '', '', '', '', '', 39653),
(63673, 'zhCN', '密院追猎', '在玛卓克萨斯找到胡恩·高岭。', '我带来了喜讯，$n。各大盟约开始通力合作之后，胡恩的追猎也成果丰厚。他发现了确凿的线索，暗影界中还有两位月夜战神。\n\n胡恩想请你到玛卓克萨斯与他会合，寻找其中一位月夜战神。他会在智识塔陵等你。\n\n动作快点，$n。艾露恩的力量正在撕碎泰兰德的灵魂，我不知道她究竟还能支撑多久。', '', '', '', '', '', '', 39653),
(63672, 'zhCN', '心之呼喊', '在森林之心与伊瑟拉碰面。', '<你念出了卷轴上的文字，伊瑟拉的声音从书卷中飘忽而出。>\n\n$n,\n\n一件紧要之事急需你的援手，请尽快到森林之心与我相会。', '', '', '', '', '', '', 39653),
(63665, 'zhCN', '奥利波斯通路', '激活道标石，前往奥利波斯。', '预言曾经揭示，终有一日，噬渊行者会需要这块休眠的道标石，它对暗影界的命运至关重要。\n\n看来，这一日终究是来了。\n\n抽取你体内的心能，激活这块道标石，与你共举大业的人就可以使用它了。\n\n倘若如你所说，塔尔-伊纳拉在奥利波斯建立了锚点，它就能将你带回我们身边。\n\n去吧，$n。告诉你的盟友，噬渊等候着他们……而刻希亚急需援助。', '', '', '', '', '', '在转移之环与伯瓦尔·弗塔根交谈。', 39653),
(63664, 'zhCN', '直击重点', '守住破灭堡内部的前沿阵地。', '通往统御祭坛的桥梁附近的我方阵地正在遭受猛攻！我们不能放弃我们在那里部署的弩炮。\n\n噬渊行者，我需要你防守那个地点，直到我们的部队能够向前推进为止！', '', '', '', '', '', '返回女男爵德拉卡身边。', 39653),
(63663, 'zhCN', '刻希亚，绝密之城', '让威·娜莉搜索这片区域，随后调查找到的线索。', '我们的愿望都快要实现了，噬渊行者。\n\n你要找的那块伟大的道标石离这里不远了。当然了，我的愿望要更加微不足道一些——一点点关于这里有用的情报，一小块无价的圣物……\n\n我会调查这片区域，看看附近有没有什么有用的或是有害的东西。然后我们再继续下一步。', '', '', '', '', '', '在惰性道标石附近与塔尔-加兰交谈。', 39653),
(63662, 'zhCN', '噬渊的秘密', '与威·娜莉一同前往噬渊中新大陆的指定地点。', '噬渊正在改变，凡人。而改变意味着机遇。\n\n典狱长将深藏在暗影界深处的一个界域拉进了噬渊。对于它的位置我很感兴趣，但我不愿孤身前往。\n\n你看，渊誓者正在涌入这个区域。他们一定是在寻找一些有价值的东西。\n\n我在附近有一处安全的飞地。陪我前往那里，我也许能够帮你找到你在寻找的那块道标石。\n\n成交吗？', '', '', '', '', '', '在新的区域外边与威·娜莉交谈。', 39653),
(63661, 'zhCN', '连通噬渊', '向威·娜莉询问第二块道标石的方位。', '命运撰写师相信，噬渊中出现了第二块道标石，寻找它的任务就交给你了。\n\n我会在奥利波斯建立一个锚点，与你的心能连接。当你激活道标石后，锚点就会与它绑定。\n\n如果你成功了，各大盟约就能派遣部队安全地出入噬渊。\n\n运用你在噬渊中拥有的一切资源去找这块道标石吧。\n\n祝你好运，凡人，愿天命指引我们。', '', '', '', '', '', '与威·娜莉的庇护所的威·娜莉交谈。', 39653),
(63660, 'zhCN', '噬渊之喉大开', '让塔尔-伊纳拉检查你的心能。', '典狱长又夺得了一个印记，他的军队也在猛烈地攻击奥利波斯。\n\n伯瓦尔·弗塔根和玛卓克萨斯的德拉卡建议向典狱长发起进攻。\n\n要这么做，我们必须想一个办法，让他们的军队能够安全地出入噬渊。\n\n在你来之前，这种想法曾被认为是无稽之谈……现在我相信，我们有机会。\n\n我必须检查一下你的心能，看看这是否正是天命的意愿。', '', '', '', '', '', '与转移之环的塔尔-伊纳拉交谈。', 39653),
(63659, 'zhCN', '恐惧魔王！', '与刻希亚的兵主交谈。', '这是我本周在军队里揪出的第五名恐惧魔王了。如果置之不理，他们就会对这处据点造成严重的损害。\n\n生前，一位恶魔猎手教会了我如何辨识这些生物。我确实可以轻轻松松地找到他们，但我一人无法兼顾各处。\n\n我们必须将这些发现上报给兵主。', '', '', '', '', '', '与刻希亚的兵主交谈。', 39653),
(63656, 'zhCN', '愤怒的真意', '向兵主报告。', '我会集结军队，立即向刻希亚派遣一支分队。我还会给他们分发瓦丝琪女男爵和凯尔萨斯制作的工具，这样才能抵御纳斯雷兹姆的进犯。\n\n在前往刻希亚之前，还有其他事务需要我去关心，我必须先确保统御要塞免受渗透者的袭扰。\n\n兵主肯定希望得知目前的状况，你可以告诉他，你此行不辱使命。', '', '', '', '', '', '向兵主报告。', 39653),
(63655, 'zhCN', '愤怒勋章', '将愤怒勋章带到堕罪堡的台座上。', '噬渊行者，我会和我的石裔魔一同进军噬渊，拧断每一个纳斯雷兹姆的脑袋。\n\n不过，雷文德斯在这场战争中的战略意义太过重要，不能因傲慢而有半分闪失。\n\n因此，作为第二任愤怒收割者，在这场战争期间，我会将勋章托付给你来保管。一定要善加利用。\n\n用它来强化收割者们，以防止德纳修斯卷土重来，弹指之间重夺控制权。', '', '', '', '', '', '将愤怒勋章带到堕罪堡的台座上。', 39653),
(63654, 'zhCN', '纳斯雷兹姆', '从纳斯雷兹姆处夺回愤怒勋章。', '愤怒勋章不只是一件强大的神器。纳斯雷兹姆可以用它们来改变这个国度，实现他们的黑暗目的。更重要的是，他们拥有了勋章，我们便失去了铸造新的温西尔印记的能力。\n\n他们的鲁莽图谋几乎摧毁了灰烬荒野，我绝不会任由我的勋章被他们所用。\n\n来吧，我们要把它夺回来。', '', '', '', '', '', '与晨曦堡的雷纳索尔王子交谈。', 39653),
(63653, 'zhCN', '冠冕之威', '追踪路径，找到愤怒勋章。', '我们准备好了。\n\n收割者之庭将使用收集到的勋章的力量，来追查愤怒勋章的下落。只要它还在这个国度之内，我们就能占卜到它的所在。\n\n这个仪式并不轻松，纳斯雷兹姆也很擅长躲避探测。探明道路后，就应该尽快赶去。\n\n如果你找到了他们，别一个人轻举妄动。', '', '', '', '', '', '在晨曦堡与锻石师交谈。', 39653),
(63652, 'zhCN', '“不速”之客', '在堕罪堡中消灭$1oa个纳斯雷兹姆。', '切尔拉，我是说娜尔拉佳丝，她肯定不是独自行动。我们必须做好最坏的打算——我们的朋友和盟友并非全都表里如一。\n\n收割者之庭需要时间来筹备检测仪式，在此期间，我们仍然暴露无遗。请在堕罪堡里重新施展你曾在统御之门使用过的技艺，揪出隐藏在我们之中的纳斯雷兹姆。\n\n狩猎愉快。', '', '', '', '', '', '', 39653),
(63651, 'zhCN', '密文', '转译$1oa份狱火密文。', '如果纳斯雷兹姆渗透了堕罪堡，他们肯定会进行通讯，并且不会是以手势或话语这么简单的方式。他们喜欢使用以魔法书写的信件，再用简单的咒语进行隐藏，寻常人士根本无从发现。\n\n不过我开发出了一个法咒，使你能够看见这些书信。\n\n找到这些密文，解读它们的内容。如果你理解不了，我可以给你翻译。', '', '', '', '', '', '', 39653),
(63650, 'zhCN', '反击渗透', '在堕罪堡与雷纳索尔王子碰面。', '玛尔加尼斯。\n\n我已经无数个世代没有提起过这个名字了，现在我们必须追捕他。\n\n如果愤怒勋章在他手中，他就无处藏身了。我们可以使用找回的其他勋章来定位他。\n\n到堕罪堡来找我，记得带上恐惧魔王狩猎小队，我们肯定用得着他们。', '', '', '', '', '', '', 39653),
(63649, 'zhCN', '谍影重重', '追踪并击败$1oa名恐惧魔王渗透者。', '纳斯雷兹姆，恐惧魔王，隐迹宾客。\n\n不管你怎么称呼他们，这个种族诞生于很久之前，天生就是世上最出色的间谍和渗透者。\n\n不过他们的侵袭低估了三个目标：凯尔萨斯·逐日者、瓦丝琪女男爵，还有$n！\n\n我带来了一件工具，凯尔萨斯和我为伊利丹效力时，就会用它来侦测纳斯雷兹姆。我可是间谍主母！\n\n我们去猎捕间谍吧。', '', '', '', '', '', '', 39653),
(63648, 'zhCN', '娜尔拉佳丝', '追踪并击败娜尔拉佳丝。', '锻石师的勋章绝不能落到纳斯雷兹姆手中。\n\n据指控者所说，如果我们想要打造出新的温西尔的印记，那枚勋章是必不可少的。我敢肯定，娜尔拉佳丝和她的同伙已经开始准备伏击了。\n\n每枚勋章上都施放了强大的魔法，它们对这个界域造成的影响很容易追踪。我建议我们应当趁娜尔拉佳丝还没有得到增援，追上去把她消灭掉。', '', '一名经验丰富的纳斯雷兹姆渗透者。', '娜尔拉佳丝', '', '', '与雷纳索尔王子交谈。', 39653),
(63647, 'zhCN', '隐迹宾客', '和锻石师一同调查特使。', '恐惧魔王。\n\n当然了，他们当然会挑这个时候卷土重来。我甚至怀疑他们在心能枯竭期间就回归了。\n\n第一次见到你的时候，我怀疑你也是其中之一。自从他们逃离雷文德斯后的无数个纪元里，他们确实变得更聪明了。\n\n但我想……他们还不够聪明。\n\n来，噬渊行者，跟着我走，不要声张，准备好武器。你带来的特使也许没你想象得那么心怀善意。', '', '', '', '', '', '', 39653),
(63646, 'zhCN', '盟约护送队', '集结使节，一同前往统御之门。', '必须集齐全部七枚勋章，才能够打造出新的温西尔的印记。\n\n兵主说得没错。我们需要找的人正是锻石师。她对隐迹者的不满能装满一座图书馆，而我们需要的最后一枚勋章就在她手里。我认为你我早该说服她加入我们的事业。\n\n我会安排这次会面。这次要用正确的方式接洽，带好赠礼，以礼相见。\n\n你最好去和切尔拉说一声，她应该会想要安排护送的人手。', '', '', '', '', '', '向锻石师传递兵主的讯息。', 39653),
(63645, 'zhCN', '晨曦堡的囚徒', '听雷纳索尔王子讲述德纳修斯大帝的命运。', '噢，你还没听过这个消息呢。\n\n我们缉拿了德纳修斯大帝，雷文德斯的主宰者，把他囚禁在自己的利剑之中。\n\n在对纳斯利亚堡发起的最近几场突袭中，我们成功制服了他。\n\n一支英勇无畏、装备精良的大军，加上娴熟的技巧和惊人的财富，再加上一场奇迹，这才达成了现在的局面。\n\n救赎者终将为自己的罪行赎罪，你还想听听细节吗？', '', '', '', '', '', '', 39653),
(63644, 'zhCN', '恐惧之讯', '在雷文德斯的晨曦堡与雷纳索尔王子交谈。', '纳斯雷兹姆对大军的威胁不容小觑。他们的诡诈能够与锐眼密院的精锐特工相提并论，而我们还无从得知他们计划的全貌。\n\n在无数个千年之前，有一名温西尔的盛怒将纳斯雷兹姆逐出了暗影界。\n\n请你前往堕罪堡，找到雷纳索尔王子，向他呈上这封信函。我会派出间谍瓦丝琪女男爵与你会合。你要利用好她与纳斯雷兹姆打交道的经验。', '', '', '', '', '', '与晨曦堡的雷纳索尔王子交谈。', 39653),
(63639, 'zhCN', '通报奥利波斯', '返回奥利波斯的塔尔-伊纳拉身边。', '炽蓝仙野在噬渊的无情大军面前屹立不倒。\n\n即便如此也远远不够。\n\n返回奥利波斯的盟友身边。我们必须就这里的损失加以回应，采取措施。', '', '', '', '', '', '返回奥利波斯的塔尔-伊纳拉身边。', 39653),
(63638, 'zhCN', '绝不背弃', '检查寒冬女王的情况。', '希尔瓦娜斯和渊誓者……暂时被击退了。\n\n但我们得抓紧时间，确保女王和她的印记安然无恙。\n\n寒冬女王就在森林之心外围，保护那些失窃的灵种，抵御噬渊的力量。', '', '', '', '', '', '', 39653),
(63625, 'zhCN', '拿上这把斧子，去干活吧！', '消灭$1oa支渊誓者部队及指挥官马拉墨尔特。', '我们的部队遭到了顽强抵抗！噬渊行者，拿起武器，和他们进行战斗！\n\n消灭防守大门的渊誓者部队及其指挥官。', '', '', '指挥官马拉墨尔特', '', '', '将你成功的消息带给德拉卡女男爵。', 39653),
(63624, 'zhCN', '我等践行之途', '见证德拉卡的晋升仪式。', '玛卓克萨斯的大军兵强马壮，他们会从维拉兹的罪行中恢复元气的。\n\n我们的第一要务就是重建家园。噬渊行者，请见证玛卓克萨斯的新时代吧！', '', '', '', '', '', '', 39653),
(63623, 'zhCN', '虚位以待', '返回兵主之座。', '噬渊行者。\n\n在我缺席的日子里，你倾尽全力，为通灵领主盟约恢复了秩序和力量。作为嘉奖，我邀你见证一个仪式。\n\n和我一同返回玛卓克萨斯的力量之座，我应该奖赏对事业忠诚不二的勇士了。', '', '', '', '', '', '与兵主之座的兵主交谈。', 39653),
(63622, 'zhCN', '胜利在握', '返回刻希亚的兵主身边。', '今天，我们解决了海拉和维拉兹。这是对抗渊誓者的一场大胜，也彰显了暗影界联合起来的伟大力量。\n\n我们必须在其他事情掀起波澜前赶回刻希亚。', '', '', '', '', '', '', 39653),
(63621, 'zhCN', '给他一点教训', '消灭锁链守护者。', '他们称这家伙为锁链守护者。不要低估他的能力。他已经束缚了附近的灵魂，准备进攻我们的阵地。\n\n我需要你去消灭这个威胁，噬渊行者，不能让其对抗我们的部队。', '', '由于被他的锁链所束缚，所有灵魂的意志都崩溃了。', '锁链守护者', '', '', '', 39653),
(63620, 'zhCN', '叛徒的终末', '消灭维拉兹。', '自从维拉兹背叛我们之后，他就一直是玛卓克萨斯的肉中刺。作为魂选密院的女男爵，我有义务消除这个威胁……为凯克苏斯侯爵报仇雪恨。\n\n正如兵主所说，我们必须斩除毒蛇的首级。\n\n现在就是出击的时刻！', '', '玛卓克萨斯的叛徒，维拉兹男爵时日无多了。', '维拉兹男爵', '', '', '', 39653),
(63619, 'zhCN', '弃誓而弃绝', '解救$1oa名弃誓囚犯。', '等等……我认识你！噬渊行者！\n\n我的兄弟姐妹们都被扭曲、玷污了。有些自愿接受了海拉的力量，但其他人心有抗拒。现在，我们都不得不在她的力量面前屈服。\n\n我在战斗一开始的时候就逃掉了，但是大部分弃誓者正在被用于恐怖的仪式中。\n\n拜托你救救他们吧。我们愿意返回晋升堡垒，听候执政官的发落。', '', '', '', '', '', '', 39653),
(63618, 'zhCN', '玛卓克萨斯之所长', '在上层渊狱消灭$1oa个渊誓者。', '我们每消灭一个敌人，军队需要抗衡的就少了一个。我们要确保他们不会遗忘玛卓克萨斯的真正使命。让他们瞧瞧，暗影界的威胁会落得什么下场。\n\n渊誓者见一个，宰一个。', '', '', '', '', '', '', 39653),
(63617, 'zhCN', '夷平阻碍', '消灭钢铁守护者萨尔利克斯。', '上层堡垒的大门在一片混乱中被打开了。只要我们溜进去，就能赶在他们有所反应之前占得先机。\n\n海拉的一位副官就挡在我们和冥锋要塞之间，终结他们。', '', '这个渊誓征服者统领着渊狱的部队，在冥世联军的攻势前负隅顽抗。', '钢铁守护者萨尔利克斯', '', '', '', 39653),
(63616, 'zhCN', '计划通', '向泽雷克利斯发出信号并开始袭击。', '我们现在可以发起袭击了。\n\n向泽雷克利斯发出信号，我们将展示玛卓克萨斯浮空城和暗影界联军的力量！', '', '', '', '', '', '', 39653),
(63615, 'zhCN', '折翅断翼', '使用渊誓锁链消灭$1oa个冥誓碎魂者。', '海拉的格里恩追随者遮蔽了天空。如果不能削减他们的数量，泽雷克利斯和空中的盟友就难以向前推进。\n\n我发现渊誓者经常使用魔法锁链。我们可以以彼之道还施彼身，将他们从空中扯下来。', '', '', '', '', '', '', 39653),
(63614, 'zhCN', '趁手神兵', '找到萨尔的斧头，德拉戈拉。', '叨扰片刻，$n。\n\n在我们初次闯入噬渊的时候，我将战斧德拉戈拉掷向了海拉，之后就再也没有见过它。如果她真的是在这里统率部队，也许战斧就被放在了这里。\n\n那把武器是我在纳格兰打造的，它让我回想起了和家人度过的美好时光。我希望能再次用双手体会它的重量。', '', '', '', '', '', '', 39653),
(63613, 'zhCN', '受诅者之门', '召唤$1oa个死亡之门。', '在向泽雷克利斯发出信号之前，我们必须为突袭做好准备。当浮空城就位之后，盟友就能通过死亡之门突袭那片区域了。\n\n我们必须在这一侧召唤死亡之门，为它们寻找战略上合理的位置吧。', '', '', '', '', '', '', 39653),
(63612, 'zhCN', '号令之链', '在渊狱附近与德拉卡碰面。', '如果我们要在靠近典狱长领地如此之近的地方站稳脚跟，就必须采取一些保障措施。\n\n维拉兹和海拉撤回了渊狱的高墙之内。他们自以为安全无虞，因此放松了警惕，这反而是我们的一个机会。\n\n我们要出其不意地发动攻势，出手利落毫不留情，也许这样就能斩落那些毒蛇们的首级。', '', '', '', '', '', '与渊狱附近的德拉卡交谈。', 39653),
(63608, 'zhCN', '河马之魂', '把河马之魂带给森林之心中的曼恩女士。', '<河马之魂野性十足。你将掌握河马形态。>', '', '', '', '', '', '把河马之魂带给森林之心中的曼恩女士。', 39653),
(63607, 'zhCN', '恐角龙之魂', '把恐角龙之魂带给森林之心中的曼恩女士。', '<恐角龙之魂残忍而顽强。你将掌握恐角龙形态。>', '', '', '', '', '', '把恐角龙之魂带给森林之心中的曼恩女士。', 39653),
(63606, 'zhCN', '蜘蛛之魂', '把蜘蛛之魂带给森林之心中的曼恩女士。', '<蜘蛛之魂灵敏而狡诈。你将掌握蜘蛛形态。>', '', '', '', '', '', '把蜘蛛之魂带给森林之心中的曼恩女士。', 39653),
(63605, 'zhCN', '巨蜥之魂', '把巨蜥之魂带给森林之心中的曼恩女士。', '<巨蜥之魂敏捷而聪颖。你将掌握巨蜥形态。>', '', '', '', '', '', '把巨蜥之魂带给森林之心中的曼恩女士。', 39653),
(63603, 'zhCN', '牦牛之魂', '把牦牛之魂带给森林之心中的曼恩女士。', '<牦牛之魂热情而强韧。你将掌握牦牛形态。>', '', '', '', '', '', '把牦牛之魂带给森林之心中的曼恩女士。', 39653),
(63593, 'zhCN', '格里恩的新印记', '向刻希亚的兵主回报。', '友谊与奉献铸就了晋升堡垒的未来，为了代表我们前进的道路，新的印记已经诞生。\n\n请向兵主回报你的努力。当他做好了准备，我们就会将印记送去。\n\n希望他能藉此挫败典狱长的图谋，拯救暗影界。', '', '', '', '', '', '向刻希亚的兵主回报。', 39653),
(63592, 'zhCN', '新正途', '与执政官之座的卡莉丝塞茵交谈以参加仪式。', '今天，一位新的圣杰得以晋升。自我们的国度诞生以来，这是首座为彰显我们对彼此的奉献而受到重导的神庙。\n\n一位新的圣杰，一枚新的印记，一条所有格里恩都可以踏上的新途。\n\n这场仪式将会辉煌之至！', '', '', '', '', '', '与奉献圣杰阿得赖斯提斯交谈。', 39653),
(63591, 'zhCN', '迎宾典礼', '与卡莉丝塞茵交谈以参加集会，然后与你的灵魂羁绊和其他格里恩互动。', '$n，你在最艰难的时刻帮助了格里恩。你对我们事业的奉献为我们揭示了新的开始。\n\n如果你愿意与我们在仪式之前共聚片刻，我们将无比荣幸。你为我们做了许多，盟约的成员们都渴望向你表达感激呢。\n\n这是无比喜悦的一天，很高兴你能来此见证！', '', '', '', '', '', '在忠诚之泉与卡莉丝塞茵交谈。', 39653),
(63590, 'zhCN', '暮钟鸣奏', '在文官阿得赖斯提斯重导忠诚神庙时保护他。', '忠诚不再是正途必须的教条之一，而是一项争取来的美德，一种选择。\n\n无论是新近抵达的灵魂，还是需要援助的同伴，我们都必须向困境中的人士展现出奉献之心。\n\n重导神庙需要消耗掉手头的所有心能，也会为格里恩开创新的纪元。\n\n我担心渊誓者会试图阻挠我们的计划。在仪式期间保护我，$n，我们必须完成这个任务。', '', '', '', '', '', '', 39653),
(63589, 'zhCN', '引领献身', '将忠诚堡垒的心能重导至神庙。', '从晋升堡垒诞生之初，五大神庙就傲然屹立。从未有人提出过要重导神庙，这么做也无疑需要海量的心能。\n\n神庙下方存储着我们为枯竭所储备的心能。如今，心能已经回归，我们可以将储备用作他途。\n\n你需要使用地上散布的引导器和收集器，将心能重新引导至顶部，为我提供急需的力量。', '', '', '', '', '', '', 39653),
(63588, 'zhCN', '重塑信仰', '说服$1oa名弃誓者重返正途。', '弃誓者迷失了，$n。\n\n他们如鬼魂一般游荡在忠诚神庙里，无处可去，群龙无首，漫无目的，孤苦伶仃。\n\n我们必须向他们证明，前进的道路是存在的。\n\n让我陪你一起进入神庙吧。我会和他们谈谈，动之以情。也许我们可以说服他们，让他们试试阿得赖斯提斯开辟的新道路。', '', '', '', '', '', '', 39653),
(63587, 'zhCN', '可回收心能', '从弃誓者百心长身上收集$1oa个被污染的百心之核。', '米卡尼科斯向我解释了弃誓者百心长的原理，$n。\n\n我不能说自己全都听懂了，不过他好像也束手无策，没法让它们恢复正常的运行逻辑。\n\n不过它们的心能还是可以利用的！\n\n阿得赖斯提斯专心于如何重导神庙，但毫不在意自己的安危。恐怕这个过程会耗尽他的心能。\n\n如果你能从弃誓者百心长身上取回核心，我们就能把它们变成为阿得赖斯提斯准备的心能贮藏。', '', '', '', '', '', '', 39653),
(63586, 'zhCN', '奉献中的同情', '与执事者之憩的阿得赖斯提斯碰面。', '我们的头等大事就是重导忠诚神庙。\n\n裴拉戈斯自愿留下来协助准备仪式，我还请尼科隆把他的同伴带到执事者之憩来会面，协助我们说服一部分弃誓者，踏上我们开辟的新途。\n\n等你有空了就来找我们吧。', '', '', '', '', '', '与执事者之憩的阿得赖斯提斯碰面。', 39653),
(63585, 'zhCN', '盲目愚忠', '在极乐堡与文官阿得赖斯提斯一同觐见执政官。', '现在，格里恩的前路向我敞开。\n\n我们首先要和尼科隆谈谈，我需要你留下来倾听。\n\n之后，我们要返回极乐堡。\n\n然后我会请求觐见执政官，我也需要你全程陪伴在我的身旁。', '', '', '', '', '', '', 39653),
(63584, 'zhCN', '凯旋而归', '与极乐堡的卡莉丝塞茵碰面。\n\n格里恩信使可以帮你飞过去。', '这座神庙代表晋升堡垒迎来了新的黎明，$n。\n\n奉献神庙将成为友谊之地。不论背景、不论出身，我们将与弃誓者、候选者和格里恩合作，打造一个所有人都能为之自豪的未来。\n\n让我们返回极乐堡吧。我需要你和我一起见证这一重要的时刻——新圣杰的晋升和新印记的诞生。', '', '', '', '', '', '与极乐堡的卡莉丝塞茵碰面。', 39653),
(63583, 'zhCN', '我打算永生不死', '协助乌瑟尔重温最后的回忆。', '$n，求你了，这还没有结束。\n\n我必须再见证一段回忆，一段我必须面对的回忆。\n\n这……并非易事，我需要你的全力支持。\n\n但我必须这么做。', '', '', '', '', '', '', 39653),
(63582, 'zhCN', '昔日爱徒', '协助乌瑟尔重温第二段回忆。', '对阿尔萨斯王子的回忆深深地纠缠着乌瑟尔。乌瑟尔的灵魂为何破碎，德沃丝为何堕落，他便是问题的答案。\n\n这些回忆中包含着显而易见的痛楚。\n\n我们必须继续深入，乌瑟尔必须面对这种黑暗的根源。\n\n和之前一样，你必须进入他的往昔，才能守护他的未来。', '', '', '', '', '', '', 39653),
(63581, 'zhCN', '没入圣光', '使用灵魂之镜，协助乌瑟尔重温往昔。', '这正是我所担心的。\n\n乌瑟尔的灵魂碎片因那把屠戮了他的哀伤剑而变得黑暗，他的回忆也破碎扭曲。\n\n要让乌瑟尔从自己的伤痛和悔恨中超脱，就必须让他再度经历那段往事。\n\n但他不必独自面对。\n\n使用我的灵魂之镜，我们要协助乌瑟尔挺过那些回忆，让他与其中涌动的情感和解。我们必须帮助他看清扭曲与不谐，让他理解其中的真意。', '', '', '', '', '', '', 39653),
(63580, 'zhCN', '创伤的回忆', '帮助乌瑟尔与正义残迹建立连接。', '乌瑟尔伤痕累累的灵魂引发了许多事件，最终导致了如今的困局。\n\n德沃丝的信仰支离破碎，随后与海拉勾结一气，并导致了弃誓者的崛起。\n\n晋升堡垒需要变革，我们却难以找到出路。\n\n也许这枚灵魂碎片能提供宝贵的见解。', '', '', '', '', '', '', 39653),
(63579, 'zhCN', '圣骑士的灵魂', '从托加斯特的放逐者的藏骨堂中夺回正义残迹。', '伯瓦尔·弗塔根在幻象中看到过，托加斯特的深处有一个隐秘的魂窟，典狱长将他看重的灵魂存放在那里。\n\n乌瑟尔曾被一把哀伤剑击伤。在怒火的加持下，这种武器足以将灵魂撕成碎片。\n\n如果典狱长握有乌瑟尔的一部分灵魂，除非取回失落的碎片，否则就无法完全修补灵魂。\n\n将这枚调谐碎片带去托加斯特，$p，它会向你指明魂窟的位置。\n\n找到乌瑟尔失落的灵魂碎片，让他能够再度完整。', '', '', '', '', '', '在晋升堡垒的智慧神庙与塞尼厄斯碰面。', 39653),
(63578, 'zhCN', '炽蓝仙野之战', '在炽蓝仙野之战中保护寒冬女王的印记。', '德纳修斯大帝已经背叛，玛卓克萨斯的兵主音讯全无，我们只能猜想，寒冬女王可能是典狱长的下一个目标。\n\n而我们不能让任何人染指她的印记！\n\n炽蓝仙野经历了重重磨难，但这个宏伟的国度蕴藏着神秘的力量，所见之景也许并非真相。\n\n不管谁要和女王作对，我们都会藉此与其抗衡。', '', '', '', '', '', '', 39653),
(63576, 'zhCN', '第一步', '在奥利波斯与文官阿得赖斯提斯交谈。', '在各大盟约努力捍卫暗影界之际，典狱长并不会闲坐在托加斯特里。他似乎想要开启阴谋的下一个阶段了。\n\n文官阿得赖斯提斯从极乐堡带来了令人不安的消息。等你抵达之后，他会重述自己的所见所闻。\n\n动作快，恐怕没剩多少时间了。', '', '', '', '', '', '', 39653),
(63543, 'zhCN', '通灵领主突袭', '在破灭堡和湮灭真容完成$1oa个任务。', '典狱长的部队被我们的攻击打了个措手不及。我们要趁势拿下破灭堡，击败他位于统御祭坛的勇士！\n\n我们需要你的帮助，噬渊行者。在战场上协助我们的部队！', '', '', '', '', '', '', 39653),
(63435, 'zhCN', '神庙踢馆', '在宠物对战中击败安希亚。', '我的父母都忙着看守……八……椰……殿？我没留神。他们大概就是因为这个才把我留在了这里。\n\n他们告诉我，我可以和大白猫一起训练！还能成为忍者！\n\n<安希亚朝你的方向猛踢了几脚。>\n\n呀！咔！你可得当心了！\n\n……\n\n我好无聊啊，你想来场宠物对战吗？我最喜爱的所有宠物都带在身边呢。', '', '', '', '', '', '', 39653),
(63100, 'zhCN', '痛苦相伴', '在戈尔格亚：聚魂之河消灭$1oa个绝望的容器。', '<这个可怜的灵魂只剩下了驱壳，别的早已被啃食殆尽，就快消散了。\n\n不能坐视这样的苦难。拯救其它的灵魂，结束它们的痛苦。>', '', '', '', '', '', '', 39653),
(63043, 'zhCN', '撕裂的灵魂', '在特玛库伦摧毁$1oa个碎魂陷阱。', '陷阱……之前对我们不起作用的。这么多灵魂……逃走了。\n\n他们……制造了新的陷阱……撕碎了逃跑的灵魂……\n\n……我已经不行了。毁了陷阱……其他人还有机会！', '', '', '', '', '', '', 39653),
(62917, 'zhCN', '共享灵魂', '与羁绊熔炉的指控者碰面。', '收割者的力量在你的凡人身躯内流淌。但你如果与他人缔结灵魂羁绊，也许就能掌握更强的力量。\n\n这么做也许会有负面作用，但也会为双方带来许多优势。\n\n指控者会监督这个过程，你准备好了就去羁绊熔炉找她吧。', '', '', '', '', '', '', 39653),
(62852, 'zhCN', '荒猎团圣杰', '与森林之心的艾丝琳谈谈。', '你好，$n！\n\n你向炽蓝仙野的全体居民证明了自己，代表着我们的英勇与机智。而我们会赠予你更多奖励。\n\n请到森林之心找我。', '', '', '', '', '', '', 39653),
(62851, 'zhCN', '不朽军团圣杰', '与伤逝剧场的纳尔考恩·塔尔森交谈。', '你在不断地帮助不朽军团实现目标，这为你在部队中赢得了越来越高的尊重。\n\n作为回报，我已获准将近期获得的部分战利品交给你使用。请尽快前往兵主之座找我，获取这些战利品。', '', '', '', '', '', '', 39653),
(62850, 'zhCN', '晋升者的典范', '在晋升堡垒的英雄之眠与副官尼科斯谈谈。', '噬渊行者。\n\n你的努力为晋升者达成他们的目标提供了决定性的优势。\n\n我们为你准备了奖励，以及感谢。', '', '', '', '', '', '', 39653),
(62849, 'zhCN', '收割者之庭的典范', '与暗湾镇的米哈拉女士交谈。', '噬渊行者。\n\n你的努力为收割者之庭提供了决定性的优势，足以对抗那些冥顽不灵，依然追随德纳修斯败业的狂热者和死忠份子。\n\n如果你能来暗湾镇找我，我们就能用一种更……实际的方式，对你表达谢意。\n\n奖励相当丰厚。', '', '', '', '', '', '', 39653),
(62611, 'zhCN', '蘑网巡逻：心木林', '乘坐蘑网，消灭心木林内的$2oa个被附身的亵渎者。', '那些戴面具的魔鬼占领了心木林，我想要阻止他们的计划。$b$B心木林曾是多么美丽的地方。如今……算了。我们来解决这个问题，你和我。就现在。$b$B来，和我一同加入战斗。我们要给这些怪物一个教训，让他们的主人对再度亵渎圣地心生忌惮！', '', '', '', '', '', '', 39653),
(62563, 'zhCN', '再次复原！', '击败损毁者格甘图斯', '格甘图斯真是执迷不悟！\n\n我们已经几次击败了她，但清道夫找回了她的尸体，带回去修复之后又让她回到了这里！\n\n她认为这次能够击败我们……要证明她是错的。', '', '一个曾遭击败并重建数次的长寿构造体。', '损毁者格甘图斯', '', '', '', 39653),
(62451, 'zhCN', '突袭前庭', '', '', '', '', '', '', '', '', 39653),
(62435, 'zhCN', '牡鹿之魂', '把牡鹿之魂带给森林之心中的曼恩女士。', '<牡鹿之魂高贵而威猛。你将掌握牡鹿形态。>', '', '', '', '', '', '把牡鹿之魂带给森林之心中的曼恩女士。', 39653),
(62432, 'zhCN', '鹰头猫之魂', '把鹰头猫之魂带给森林之心中的曼恩女士。', '<鹰头猫之魂外表奇特，又酷爱恶作剧，是众多部件以顽皮的平衡组合运作的一种野兽，总是不断寻找着新的挑战。你将掌握鹰头猫形态。>', '', '', '', '', '', '把鹰头猫之魂带给森林之心中的曼恩女士。', 39653),
(62427, 'zhCN', '角鹰兽之魂', '把角鹰兽之魂带给森林之心中的曼恩女士。', '<角鹰兽之魂智慧而勇敢。你将掌握角鹰兽形态。>', '', '', '', '', '', '把角鹰兽之魂带给森林之心中的曼恩女士。', 39653),
(62294, 'zhCN', '巫妖之砒霜……', '搜索祭仪密院的碎石堆，寻找其过往的线索，并找回一件有趣的远古遗物。', '常言道：“彼之砒霜，我之蜜糖。”遗物更是如此。\n\n祭仪密院对内部事务总是讳莫如深，这意味着我们能收集到的任何信息都有探索的价值。\n\n只要翻遍他们的垃圾堆，我们一定可以找到许多珍宝。', '', '', '', '', '', '', 39653),
(62258, 'zhCN', '飞越晋升堡垒', '', '', '', '', '', '', '', '', 39653),
(62239, 'zhCN', '除鼠行动', '使用拷问者之杖，对野兽密径中的$1oa只巨型噬渊鼠进行测试。', '<武器发出了嗡鸣声，涌动着带着静电的黑暗能量。无论这个渊誓者想要测试什么，附近的啮齿动物都证明了，试验非常成功。\n\n也许进一步的调查能让你收获更多信息。>', '', '', '', '', '', '向威·娜莉的庇护所的威·娜莉报告你的发现。', 39653),
(62235, 'zhCN', '平息他们的恐惧', '', '', '', '', '', '', '', '', 39653),
(62224, 'zhCN', '一线希望', '收集$1oa条灌注心能的丝线', '魅夜王庭就像一朵干渴的鲜花，迅速地吸收着营养。如果供应充足，它就会盛开；如果供应枯竭，它就会凋零。\n\n我们的根已经开始干枯，我们需要更多心能！\n\n我已经派遣工人外出，沿着跨越炽蓝仙野的道路和小径放置丝线捕捉器。这些捕捉器可以收集一点点心能，虽然不多，但足以满足我们的需求。\n\n找到那些捕捉器，将灌注心能的丝线带回给我们。', '', '', '', '', '', '', 39653),
(62058, 'zhCN', '百心长，集结！', '', '', '', '', '', '', '', '', 39653),
(61737, 'zhCN', '失窃之人', '与纳兹戈林谈谈绑架的情况。', '我们得告诉你许多事情，$n。\n\n天灾军团又回来了。统御头盔被摧毁后，邪恶的天灾军团开始横行无忌。\n\n更糟的是，希尔瓦娜斯·风行者派出了她的特工，潜入了我们王国的中心，绑走了能够在战争中阻挠她的人。\n\n去和纳兹戈林谈谈，剩下的由他告诉你。', '', '', '', '', '', '向纳兹戈林询问绑架的情况。', 39653),
(61736, 'zhCN', '失窃之人', '与萨莉·怀特迈恩谈谈绑架的情况。', '我们得告诉你许多事情，$n。\n\n天灾军团又回来了。统御头盔被摧毁后，邪恶的天灾军团开始横行无忌。\n\n更糟的是，希尔瓦娜斯·风行者派出了她的特工，潜入了我们王国的中心，绑走了能够在战争中阻挠她的人。\n\n去和怀特迈恩谈谈。剩下的由她告诉你。', '', '', '', '', '', '向萨莉·怀特迈恩询问绑架的情况。', 39653),
(61630, 'zhCN', '附魔：永燃烙铁', '', '', '', '', '', '', '', '', 39653),
(61621, 'zhCN', '烹饪：串烧肉', '', '', '', '', '', '', '', '', 39653),
(61610, 'zhCN', '钓鱼：骷髅跃泥鱼', '', '', '', '', '', '', '', '', 39653),
(61608, 'zhCN', '附魔：坚不可摧的水晶', '', '', '', '', '', '', '', '', 39653),
(61607, 'zhCN', '烹饪：蜘蛛肉干', '', '', '', '', '', '', '', '', 39653),
(61604, 'zhCN', '裁缝：伪装斗篷', '', '', '', '', '', '', '', '', 39653),
(61545, 'zhCN', '草药学：饱满的髓根草', '', '', '', '', '', '', '', '', 39653),
(61467, 'zhCN', '采矿：微光珀银矿簇', '', '', '', '', '', '', '', '', 39653),
(61449, 'zhCN', '制皮：钢皮背心', '', '', '', '', '', '', '', '', 39653),
(61157, 'zhCN', '开门见山', '从长角野兽身上收集$1oa个极乐之角。', '以前，晋升堡垒长角的野兽经常被用于候选者的训练，但后来这份职责基本全被百心长格斗单位代替了。在过去的数个纪元里，这些野兽的数量已经膨胀了许多，现在必须进行控制了。\n\n它们的角是我们的工作中关键的材料。许多样本因为在战斗中用过，所以已经破损了，这样可不够。你收集的时候要仔细一点。\n\n挑战它们，击败它们，把它们的角带给我。', '', '', '', '', '', '', 39653),
(60958, 'zhCN', '单枪匹马', '', '', '', '', '', '', '', '', 39653),
(60869, 'zhCN', '满怀希望', '在银色比武场建立一个通往奥格瑞玛的传送门，将消息传给奥格瑞玛格罗玛什要塞的洛瑟玛·塞隆。', '你一定要将我们的发现带回奥格瑞玛。在比武场有一位我们的法师会为你开启传送门。\n\n至于银色北伐军，我们必须留下防守，对抗天灾军团。如果你希望回来继续帮助我们，我保证你的能力必有用武之地。\n\n愿圣光保佑你，$n。', '', '', '', '', '', '', 39653),
(60861, 'zhCN', '暗影中的秘密', '在莫德雷萨内使用通敌者的长袍，发现其中深藏的秘密。', '虽然我们一直监视着诅咒教派在莫德雷萨的动向，但我们还不知道大厅中深藏的秘密。\n\n穿上这件长袍，潜入内部圣殿，看看你能有什么发现。\n\n要想摸清他们的企图，这也许是我们唯一的机会了，$n。', '', '', '', '', '', '', 39653),
(60775, 'zhCN', '合适的结局', '在噬渊中将$1oa个魂铸之核扔进佐瓦尔的坩埚的灵魂熔炉中。', '在这个可悲的地方求生并非易事，但我得承认……送渊誓者去死也让我非常愉快。\n\n佐瓦尔的坩埚的铸魂者是典狱长手下最残忍的爪牙。我喜欢将他们的魂铸之核扔进他们自己维护的熔炉里。\n\n如果你还想多找几个理由的话，这还能暂时延缓他们的武器生产。', '', '', '', '', '', '', 39653),
(60767, 'zhCN', '天灾归来', '将沃农中尉的报告带给在暴风城贸易区的指挥官格雷戈。', '把我的报告带给指挥官格雷戈，他必须知道我们在对抗着什么。\n\n天灾军团的数量还在上升，如果不能削减数量……那我们就只能祈求圣光的庇佑了。', '', '', '', '', '', '', 39653),
(60658, 'zhCN', '无尽饕餮', '', '', '', '', '', '', '', '', 39653),
(60653, 'zhCN', '破镜重圆', '', '', '', '', '', '', '', '', 39653),
(60597, 'zhCN', '戈姆蛴围栏的麻烦', '', '', '', '', '', '', '', '', 39653),
(60534, 'zhCN', '不忠的居民', '', '', '', '', '', '', '', '', 39653),
(60132, 'zhCN', '星筹手稿和冥殇', '', '噬渊中有许多地方值得探索，也有许多东西能让你在未来赚取利益。\n\n信息就是一种投资。\n\n这里的许多物品都很有意思，如果你能找到它们，我很高兴能跟你交易。\n\n你去找一个来，价钱好商量。', '', '', '', '', '', '', 39653),
(60117, 'zhCN', '北伐军归来', '前往暴风城的贸易区，与指挥官格雷戈谈一谈。', '天灾军团那无法束缚的饥饿感已经显现，这些怪物冲入我们的街道只是时间问题。\n\n我们需要应对这一威胁的专业人士。黑锋骑士团的死亡骑士已经挺身而出帮助我们，但即使是他们也无法孤军奋战。\n\n银色北伐军响应了召唤。我需要你和他们合作，保护我们人民的安全，$n。\n\n我已经把你到达的消息告诉了他们的指挥官。他在城门内的营地等你。', '', '', '', '', '', '', 39653),
(60004, 'zhCN', '英勇之举', '在比武场中救援$1oa名受伤的勇士。', '我们很久没有遭遇到人数如此众多的天灾军团了，我们并未准备好应付这么大规模的突袭。\n\n尽管我们把很多人护送到了安全的地方，混乱之中还是有些人受了伤。\n\n到训练场去寻找这次袭击的幸存者。\n\n我们需要团结一切可用的力量。', '', '', '', '', '', '', 39653),
(59598, 'zhCN', '对灵魂有好处', '与梅里克交谈。', '两个灵魂总比一个好！比起各自为战，携手合作一定能取得更大的成就。\n\n不过，这并不是说只靠我们两个来对抗所有的威胁。在今后的战斗中，还会有更多人帮助我们。\n\n我们去和梅里克谈谈，了解这件事的详情。别害羞——我会给你引荐的！', '', '', '', '', '', '', 39653),
(59259, 'zhCN', '永恒折磨者', '', '', '', '', '', '', '', '', 39653),
(58707, 'zhCN', '收集幻象', '', '', '', '', '', '', '', '', 39653),
(58207, 'zhCN', '灭虫行动', '', '', '', '', '', '', '', '', 39653),
(58084, 'zhCN', '灵魂诱捕', '', '', '', '', '', '', '', '', 39653),
(57537, 'zhCN', '掩盖踪迹', '和德拉卡一起前往魂选密院。', '我是魂选密院的人。我们在南边有个据点，那里应该很安全。\n\n剩下的路程我们飞过去，当你准备好的时候就去我的绽翼兽那里。', '', '', '', '', '', '', 39653),
(57513, 'zhCN', '敌人的敌人', '逃离伤逝剧场。', '我毫不怀疑你一头雾水，但你要知道我们在这片土地上有共同的敌人。\n\n现在，我们必须前进。我会带你去一个更安全的地方，然后我们就可以谈谈了。', '', '', '', '', '', '', 39653),
(56905, 'zhCN', '黑色末日花冠', '从暮色森林，银松森林和凄凉之地中采集花朵。', '多么阴郁的花朵……但是它们也有着独特的美，你认为呢？如果它们不会凋零就好了。\n\n请允许我协助你。\n\n每逢新年，都会有类似的花朵在世界各处绽放。它们与艾露恩之间存在着特殊的联系……我可以以此进行强化。如果你能把它们带来给我，我就能对它们进行强化，使它们保持的时间更久。', '', '', '', '', '', '返回月光林地寻找迈瑞尔·月华。', 39653),
(56470, 'zhCN', '给狗狗一根骨头', '从巨型髓蛆身上收集$1oa份髓蛆血肉。', '路易森把狗骨借给了我，让我帮忙寻找髓蛆，但我忙着照看炉子，所以你可以行行好，帮我去消灭髓蛆吗？\n\n狗骨喜欢追逐那些小型的啮咬者，这会发出很大噪音，从而使大型的髓蛆受到惊吓，四处奔逃。而这时就是你行动的时候了。\n\n使用这块骨头，把狗骨引诱到啮咬者附近。之后别忘了收集巨型髓蛆掉落的肉，毕竟这可是我们的目的。', '', '', '', '', '', '', 39653),
(56364, 'zhCN', '锈栓回收品：狂乱的利齿青鱼', '将$1oa个雷银矿石交给斯卡基特。', '', '', '', '', '', '', '', 39653),
(56363, 'zhCN', '锈栓回收品：狂乱的利齿青鱼', '将$1oa个雷银矿石交给吉拉·交线。', '', '', '', '', '', '', '', 39653),
(56071, 'zhCN', '反同步震刃', '将反同步震刃交给锈栓镇的莉吉特。', '这把剧烈震动的利刃让你想起了锈栓守卫者用的兵器。显然有人能修好它。', '', '', '', '', '', '', 39653),
(55888, 'zhCN', '勇士卡莉娜，寒冰之枪', '', '', '', '', '', '', '', '', 39653),
(55605, 'zhCN', 'NOT USED', '在麦卡贡收集$1oa个备用零件。', 'TBD Collect Spare Parts from anything on the island.', '', '', '', '', '', '', 39653),
(55036, 'zhCN', '恐怖之地', '完成恩佐斯的幻象。', '你可能也注意到艾泽拉斯发生的异象了。古神正在崛起，这对我们所有人来说都是一个坏消息。\n\n这种时候，无尽真相之柱就会出现。这名字不错吧？我很擅长起名字。\n\n我说到哪儿了？哦对，这些柱子可以让你进入古神的意志。他们会提示你接下来会发生什么，告诉我们如果我们没有击败他，这个世界会变成什么样子。\n\n你准备好亲眼见证了吗？', '', '', '', '', '', '', 39653),
(54840, 'zhCN', '阿加丝·苦艾', '', '', '', '', '', '', '', '', 39653),
(54482, 'zhCN', '制皮图样', '', '', '', '', '', '', '', '', 39653),
(54352, 'zhCN', '黑海岸捐赠：烁鳞潜水装', '', '', '', '', '', '', '', '', 39653),
