(51297, 'zhCN', '托尔达戈：沿岸陆地的财产', '', '', '', '', '', '', '', '', 39653),
(48620, 'zhCN', '大型侵入点：妖女奥露拉黛儿', '', '', '', '', '', '', '', '', 39653),
(46506, 'zhCN', '萨格拉斯之墓：死后的生命', '', '', '', '', '', '', '', '', 39653),
