(41550, 'zhCN', '厚切培根', '', '', '', '', '', '', '', '', 39653),
(41512, 'zhCN', '邪能球茎', '', '', '', '', '', '', '', '', 39653),
(41243, 'zhCN', '巨型至高岭鲑鱼', '', '', '', '', '', '', '', '', 39653),
(41210, 'zhCN', '硫磺毁灭者', '', '', '', '', '', '', '', '', 39653),
(41127, 'zhCN', '泥鼻横行', '', '', '', '', '', '', '', '', 39653),
(41090, 'zhCN', '山岭之王', '', '', '', '', '', '', '', '', 39653),
(32105, 'zhCN', '完好如初的石碑底座', '将神器进行展览。', '这件神器的恢复状况极为良好。或许你该把它放在闻道之座进行展览，好让那些游学者和考古学家们进行研究。', '', '', '', '', '', '', 39653),
(28365, 'zhCN', '<PH>崔泽尔安全了', '', '', '', '', '', '', '', '', 39653),
(28071, 'zhCN', '征召冒险者：黑石塔', '与阿克莱德交谈。', '安度因·乌瑞恩国王要求所有身强力壮的冒险者前往摩根的岗哨西北边的黑石塔，立即动身！$B$B奈法利安的军队和雷德·黑手的爪牙正威胁着王国的主权！如果你愿意响应号召，就前往黑石塔，与阿克莱德谈谈。他是我们在那里唯一的联系人，也许你可以帮助我们阻止这场即将到来的入侵。', '', '', '', '', '', '', 39653),
(14089, 'zhCN', '驰骋在提瑞斯法林地', '将这本小册子交给提瑞斯法林地布瑞尔的维尔玛。', '这本关于骑乘训练和坐骑购买的广告小册子是由维尔玛·瓦纳姆派发出来的。$B$B你可以在提瑞斯法林地的布瑞尔找到他。', '', '', '', '', '', '', 39653),
(14083, 'zhCN', '驰骋在丹莫罗', '将这本小册子交给丹莫罗冻石农场的奥萨姆·铁角。', '这本关于骑乘训练和坐骑购买的广告小册子是由奥萨姆·铁角派发出来的。$B$B你可以在丹莫罗的冻石农场找到奥萨姆。那里就在铁炉堡向东的大道旁边。', '', '', '', '', '', '', 39653),
(8740, 'zhCN', '暮光掠夺者', '干掉暮光掠夺者莫娜和2个暮光掠夺者。任务完成之后向唤风者梅恩·长角报告。你还必须随身携带战术任务简报 IX以完成这个任务。', '许多幕光之锤的骑兵教徒经常在我们塞纳里奥要塞守卫范围之外的区域游荡，并伺机袭击我们巡逻和商旅小队。$B$B找到并击败暮光掠夺者和他们的领袖，一个叫做莫娜的恐怖战士。当任务完成之后向唤风者梅恩·长角报告。', '', '', '', '', '', '', 39653),
(8737, 'zhCN', '灰烬公爵', '设法召唤并击杀灰烬公爵，然后向塞纳里奥要塞的唤风者梅恩·长角复命。', '暮光之锤和深渊议会之间的联系看来比我们想象的还要意义重大。$B$B根据可靠情报，那个被称作灰烬公爵的元素领主将要策动暮光之锤对塞纳里奥要塞实施一次大规模的攻击。设法把他引诱出来，然后击杀他。', '', '', '', '', '', '', 39653),
(8538, 'zhCN', '圣殿骑士', '设法召唤并击杀四个深渊圣殿骑士，然后向塞纳里奥要塞的唤风者梅恩·长角复命。', '暮光之锤和深渊议会之间的联系看来比我们想象中的还要意义重大。$B$B根据可靠情报，那些被称作深渊圣殿骑士的元素领主们可能正在策动暮光之锤对塞纳里奥要塞实施一次大规模的攻击。设法把他们引诱出来，然后击杀他们。', '', '', '', '', '', '', 39653),
(8067, 'zhCN', '权力珍宝：捕猎者衬肩', '从祖尔格拉布把以下权力珍宝带给盲眼法希尔：1块原始哈卡莱盾牌。你还必须在赞达拉部族中达到崇敬或更高的声望。$B$B盲眼法希尔在荆棘谷的尤亚姆巴岛上。', '赞达拉部族将衣着视为成就的象征。你无需观察别人的衣着，只需感觉它所散发的力量——力量超越视觉。赞达拉捕猎者的衣服正是如此，他们最珍视的莫过于衬肩了。衬肩能使他们的身形变得模糊……并可以随心所欲地显形。$B$B去祖尔格拉布取回我需要的权力珍宝，捕猎者衬肩就属于你了。', '', '', '', '', '', '', 39653),
(8066, 'zhCN', '权力珍宝：捕猎者腰带', '从祖尔格拉布把以下权力珍宝带给盲眼法希尔：1条原始哈卡莱披肩。你还必须在赞达拉部族中达到尊敬或更高的声望。$B$B盲眼法希尔在荆棘谷的尤亚姆巴岛上。', '捕猎者知道如何追踪猎物，而成功的捕猎者知道如何一击解决他的猎物。你必须掌握这两种技能才能在祖尔格拉布生存下来，才有可能具备赞达拉捕猎者的风采……$B$B从祖尔格拉布带回我需要的权力珍宝。我将抽取那些东西的力量，而你会得到赞达拉捕猎者腰带——这是笔好买卖，相信我。', '', '', '', '', '', '', 39653),
(8062, 'zhCN', '权力珍宝：捕猎者护腕', '从祖尔格拉布把以下权力珍宝带给盲眼法希尔克：1条原始哈卡莱护腕。你还必须在赞达拉部族中达到友善或更高的声望。$B$B盲眼法希尔克在荆棘谷的尤亚姆巴岛上。', '在古拉巴什帝国毁灭后的黑暗岁月里，赞达拉捕猎者凭借自己的能力维系着部族的生存。猎人跟我们部族的捕猎者很像——狩猎便是捕猎者的基本工作。你在祖尔格拉布的狩猎之旅将证明你有没有资格成为捕猎者中的一员。$B$B从祖尔格拉布取回权力珍宝吧，如果你成功了，那么你就会在成为捕猎者的生涯中迈出第一步。', '', '', '', '', '', '', 39653),
(4133, 'zhCN', '薇薇安·拉格雷', '与卡加斯的暗法师薇薇安·拉格雷谈一谈。', '暗法师薇薇安·拉格雷需要你的帮助。她在荒芜之地，就在兽人的卡加斯前哨基地里，她在那里对有关黑铁矮人的事情进行调查。$B$B去和薇薇安谈谈吧，她正在等着你。', '', '', '', '', '', '', 39653);
